(135, 27, 166, '16', '16', '', '<p><strong>Estas condiciones son las de la aduana</strong></p>\r\n<p>&nbsp;</p>\r\n<p>Lorem ipsum dolor sit amet, consectetur adipiscing elit. Cras a libero elementum, dictum velit at, hendrerit libero. Quisque viverra magna in neque pellentesque convallis. Nullam non vestibulum nisl, id egestas eros. Nunc orci justo, fermentum ac justo id, laoreet placerat nisi. Nulla in consectetur enim. Nunc tempor ligula sit amet porta consequat. Nulla sed nunc enim. Proin est purus, fringilla at turpis eu, facilisis suscipit magna. Morbi justo metus, gravida vel eros eget, imperdiet mattis magna. Maecenas auctor tempus vestibulum. Vivamus auctor consectetur erat venenatis maximus. Vestibulum ut urna nec tellus malesuada cursus. Pellentesque ut nunc erat. Donec quis accumsan nisl. Praesent eget viverra enim.</p>', ''),
