\"font-family: Arial-BoldMT;\">BASE DE LIQUIDACION </span></strong></td>\r\n<td style=\"border: 1px solid #000000;\" align=\"left\" valign=\"middle\"><strong><span style=\"font-family: Arial-BoldMT;\">TARIFA</span></strong></td>\r\n</tr>\r\n<tr>\r\n<td>Asesor&iacute;as solicitud de<br />resoluciones DIAN.</td>\r\n<td>Por tramite</td>\r\n<td>$ 1.000.000</td>\r\n</tr>\r\n<tr>\r\n<td colspan=\"3\"><em><strong>Observaciones: Esta tarifa est&aacute; dada para tr&aacute;mite y solicitud de inscripciones ante la DIAN.</strong></em></td>\r\n</tr>\r\n<tr>\r\n<td rowspan=\"2\">Gastos de vi&aacute;ticos por tramites<br />en administraciones donde no<br />contamos con oficinas (CLO,<br />BAQ,SMR, MDE)</td>\r\n<td>2 Primeras d&iacute;as</td>\r\n<td>$ 450.000</td>\r\n</tr>\r\n<tr>\r\n<td>D&iacute;a adicional</td>\r\n<td>$ 200.000</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<p>&nbsp;</p>\r\n<p>Observaciones: Con el &aacute;nimo de ofrecer a nuestros clientes el manejo de tr&aacute;mites aduaneros en las principales administraciones del pa&iacute;s nuestros funcionarios cuentan con vinculaci&oacute;n a nivel nacional ante la DIAN, para as&iacute; poder prestar nuestros servicios.<br /><br /><em><strong>NOTA: La tarifa mencionada no incluye costos de tiquetes; en caso de presentarse, estos ser&aacute;n facturados como un pago a tercero con su respectivo soporte.</strong></em></p>\r\n<p>&nbsp;</p>\r\n<p style=\"color: #ff0000; text-align: center;\"><strong>CUSTOM</strong></p>\r\n<p>&nbsp;</p>\r\n<table class=\"tabla\" style=\"width: 70%;\" border=\"1\" cellspacing=\"0\" cellpadding=\"2\" align=\"center\">\r\n<tbody>\r\n<tr>\r\n<td style=\"color: white; text-align: center; width: 393.8px;\" colspan=\"3\" align=\"center\" bgcolor=\"#0154b6\">TARIFAS TRAMITE IMPORTACION: APLICAN POR DOCUMENTO DE TRANSPORTE (AWB Y/O BL)</td>\r\n</tr>\r\n<tr>\r\n<td>&bull; De USD 1 Hasta USD 50.000 Tarifa M&iacute;nima.<br />&bull; De USD 50.001 Hasta USD 200.000 USD 0,25%. sobre valor CIF<br />NOTA: Para pr