tener la suficiente informaci&oacute;n sobre la mercanc&iacute;a (cat&aacute;logos, fichas t&eacute;cnicas, etc.) para su respectiva clasificaci&oacute;n arancelaria. En caso de que la mercanc&iacute;a sea parcializada por la aerol&iacute;nea- naviera y/o se deba presentar nacionalizaciones separadas y/o parciales, se cobrar&aacute;n los costos y agenciamiento generados por cada proceso de operaci&oacute;n de nacionalizaci&oacute;n. Servicios o actividades no incluidas expresamente en este documento o sus anexos se entienden excluidos y se cobrar&aacute;n por separado.</p>', '');
