proyectos superiores a USD 200.0001 concretamos la tarifa a aplicar</td>\r\n<td>$ 220.000</td>\r\n</tr>\r\n<tr>\r\n<td>&bull; Tarifa Adicional por descargue Directo Aeropuerto (Cuando se requiera)</td>\r\n<td>$ 100.000</td>\r\n</tr>\r\n<tr>\r\n<td>&bull; Inspecci&oacute;n Previa En Bogot&aacute; y Acompa&ntilde;amiento en puertos (Por Doc. De Transporte<br />Carga normal LCL Hasta 6 Horas). Hora adicional $ 12.000<br />La anterior tarifa tambi&eacute;n aplica para Acompa&ntilde;amiento Inspecci&oacute;n Previa en Puertos<br />en contenedor de 20 pies y 40 Pies.</td>\r\n<td>$ 80.000</td>\r\n</tr>\r\n<tr>\r\n<td>&bull; Inspecci&oacute;n Previa en Bogot&aacute; Contenedor de 20 pies</td>\r\n<td>$ 140.000</td>\r\n</tr>\r\n<tr>\r\n<td>&bull; Inspecci&oacute;n Previa pies en Bogot&aacute; Contenedor de 40</td>\r\n<td>$ 180.000</td>\r\n</tr>\r\n<tr>\r\n<td colspan=\"2\">NOTA: Para carga extradimensionada y/o registro de alto n&uacute;mero de referencias se acordar&aacute; la tarifa a aplicar de acuerdo a tarifa del operador portuario).<br />La inspecci&oacute;n previa en los puertos ser&aacute; facturado al costo del operador portuario y se adjuntar&aacute; el soporte correspondiente como pago realizado a terceros).</td>\r\n</tr>\r\n<tr>\r\n<td>&bull; Elaboraci&oacute;n y Formularios Declaraci&oacute;n Importaci&oacute;n c/u</td>\r\n<td>$ 15.000</td>\r\n</tr>\r\n<tr>\r\n<td>&bull; Elaboraci&oacute;n y Formularios Declaraci&oacute;n Andina de Valor c/u</td>\r\n<td>$ 15.000</td>\r\n</tr>\r\n<tr>\r\n<td>&bull; Elaboraci&oacute;n Licencias Vuce Hoja Principal (hasta 1800 caracteres)</td>\r\n<td>$ 80.000</td>\r\n</tr>\r\n<tr>\r\n<td>&bull; Elaboraci&oacute;n Licencias Vuce Hoja Adicional</td>\r\n<td>$ 45.000</td>\r\n</tr>\r\n<tr>\r\n<td>&bull; Tramites Vistos Buenos (Mincomercio, Dian, Invima, Ica y dem&aacute;s entidades cuando se<br />requieran en la ejecuci&oacute;n de los procesos) Hasta 4 productos.</td>\r\n<td>$ 60.000</td>\r\n</tr>\r\n<tr>\r\n<td>&bull; Clasificaci&oacut