ull; Tramites Vistos Buenos (Mincomercio, Dian, Invima, Ica y dem&aacute;s entidades cuando se requieran en la ejecuci&oacute;n de los procesos) Hasta 4 productos.</td>\r\n<td>$ 60.000</td>\r\n</tr>\r\n<tr>\r\n<td>&bull; Gastos Varios Agrupados</td>\r\n<td>$ 80.000</td>\r\n</tr>\r\n<tr>\r\n<td>&bull; Recargo Adicional por tr&aacute;mite en Complejo Agua Dulce (B/ventura)</td>\r\n<td>$ 80.000</td>\r\n</tr>\r\n<tr>\r\n<td colspan=\"2\">&bull; IVA 19% (Sobre Ingresos Propios)</td>\r\n</tr>\r\n<tr>\r\n<td colspan=\"2\">INGRESOS A TERCEROS: (Formularios al Costo, gastos bancarios 4x1000, no incluidos)</td>\r\n</tr>\r\n<tr>\r\n<td>&bull; Formularios Licencias VUCE</td>\r\n<td><span style=\"color: #000000;\">$ 30.000</span></td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<p>&nbsp;</p>\r\n<table class=\"tabla\" style=\"width: 70%;\" border=\"1\" cellspacing=\"0\" cellpadding=\"2\" align=\"center\">\r\n<tbody>\r\n<tr>\r\n<td style=\"color: white; text-align: center; width: 393.8px;\" colspan=\"2\" align=\"center\" bgcolor=\"#0154b6\">TARIFAS EXPORTACI&Oacute;N ESPECIALES ARTES ANDINOS: APLICAN POR DOCUMENTO DE TRANSPORTE (AWB Y/O BL)</td>\r\n</tr>\r\n<tr>\r\n<td>&bull; Comisi&oacute;n M&iacute;nima hasta 3 Exportadores (Factura individual x exportador) 1 BL<br />por contenedor.</td>\r\n<td>$ 470.000</td>\r\n</tr>\r\n<tr>\r\n<td>&bull; Tarifa a partir de 4 Exportadores (Factura individual x exportador)<br />Este valor se adiciona a la comisi&oacute;n m&iacute;nima</td>\r\n<td>$ 82.000</td>\r\n</tr>\r\n<tr>\r\n<td>&bull; Elaboraci&oacute;n declaraci&oacute;n Exportaci&oacute;n DEX (Por Factura de cada exportador)</td>\r\n<td>$ 15.000</td>\r\n</tr>\r\n<tr>\r\n<td>&bull; Acompa&ntilde;amiento Inspecci&oacute;n Antinarc&oacute;ticos Domingos y Festivos</td>\r\n<td>$ 72.000</td>\r\n</tr>\r\n<tr>\r\n<td colspan=\"2\">NOTA: Los sellos de seguridad, se facturan al costo. Los dem&aacute;s &iacute;tems que requieran estos procesos de exportaci&oacute;n, aplican las tarifas normales.</td>\r\n</tr>\r\n<tr>\r\n<td>&bull; Gastos Varios Agrupados</td>\r\n<td>$ 80.000</td>\r\n</tr>\r\n<tr>\r\n<td>&bull; Recargo Adicional por tr&aacute;mite en Complejo Agua Dulce (B/ventura)</td>\r\n<td>$ 80.000</td>\r\n</tr>\r\n<tr>\r\n<td colspan=\"2\">&bull; IVA 19% (Sobre Ingresos Propios)</td>\r\n</tr>\r\n<tr>\r\n<td colspan=\"2\"><strong>INGRESOS A TERCEROS: (Formularios al Costo, gastos bancarios 4x1000, no incluidos)</strong></td>\r\n</tr>\r\n<tr>\r\n<td>&bull; Formularios Licencias VUCE</td>\r\n<td>$ 30.000</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<p>&nbsp;</p>\r\n<p class=\"western\" style=\"margin-bottom: 0.28cm; border: none; padding: 0cm; line-height: 108%; orphans: 2; widows: 2;\" align=\"left\"><strong>NO INCLUYE</strong> gastos como liberaciones, cargue, descargue, formularios, gastos en puerto, ni pago de impuestos arancelarios, etiquetado, etc. Las operaciones de importaci&oacute;n por v&iacute;a mar&iacute;tima toman en promedio cinco (5) d&iacute;as h&aacute;biles como m&aacute;ximo y tres (3) d&iacute;as h&aacute;biles como m&aacute;ximo para operaciones a&eacute;reas, contados a partir de la disponibilidad de la carga en el dep&oacute;sito de aduanas, puerto o aeropuerto, siempre y cuando contemos con toda la documentaci&oacute;n completa y correcta antes de la llegada de la mercanc&iacute;a al pa&iacute;s. Es muy importante tener en cuenta que cuando la mercanc&iacute;a requiera registro de importaci&oacute;n y vistos buenos se requiere las facturas proformas y datos de la mercanc&iacute;a para elaborarlos, obtener los permisos y vistos buenos seg&uacute;n la entidad, estos llevar&aacute;n el respectivo soporte de pago para la obtenci&oacute;n del mismo seg&uacute;n la tarifa vigente de cada entidad. Para el caso del INVIMA tiene un per&iacute;odo de cinco (5) d&iacute;as h&aacute;biles para el estudio y aprobaci&oacute;n del r&eacute;gimen de previa. Todos deben obtenerse antes de la llegada de la carga para su normal nacionalizaci&oacute;n. Es necesario tener la suficiente informaci&oacute;n sobre la mercanc&iacute;a (cat&aacute;logos, fichas t&eacute;cnicas, etc.) para su respectiva clasificaci&oacute;n arancelaria. En caso de que la mercanc&iacute;a sea parcializada por la aerol&iacute;nea- naviera y/o se deba presentar nacionalizaciones separadas y/o parciales, se cobrar&aacute;n los costos y agenciamiento generados por cada proceso de operaci&oacute;n de nacionalizaci&oacute;n. Servicios o actividades no incluidas expresamente en este documento o sus anexos se entienden excluidos y se cobrar&aacute;n por separado.</p>', '');
