tr>\r\n<tr>\r\n<td style=\"color: #000000; text-align: center;\">&bull; Acompa&ntilde;amiento Inspecci&oacute;n Antinarc&oacute;ticos Domingos y Festivos</td>\r\n<td style=\"color: #000000; text-align: center;\">$ 72.000</td>\r\n</tr>\r\n<tr>\r\n<td style=\"color: #000000; text-align: center;\" colspan=\"2\">NOTA: Los sellos de seguridad, se facturan al costo. Los dem&aacute;s &iacute;tems que requieran estos procesos de exportaci&oacute;n, aplican las tarifas normales.</td>\r\n</tr>\r\n<tr>\r\n<td style=\"color: #000000; text-align: center;\">&bull; Gastos Varios Agrupados</td>\r\n<td style=\"color: #000000; text-align: center;\">$ 80.000</td>\r\n</tr>\r\n<tr>\r\n<td style=\"color: #000000; text-align: center;\">&bull; Recargo Adicional por tr&aacute;mite en Complejo Agua Dulce (B/ventura)</td>\r\n<td style=\"color: #000000; text-align: center;\">$ 80.000</td>\r\n</tr>\r\n<tr>\r\n<td style=\"color: #000000; text-align: center;\" colspan=\"2\">&bull; IVA 19% (Sobre Ingresos Propios)</td>\r\n</tr>\r\n<tr>\r\n<td style=\"color: #000000; text-align: center;\" colspan=\"2\"><strong>INGRESOS A TERCEROS: (Formularios al Costo, gastos bancarios 4x1000, no incluidos)</strong></td>\r\n</tr>\r\n<tr>\r\n<td style=\"color: #000000; text-align: center;\">&bull; Formularios Licencias VUCE</td>\r\n<td style=\"color: #000000; text-align: center;\">$ 30.000</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<p>&nbsp;</p>\r\n<p class=\"western\" style=\"margin-bottom: 0.28cm; line-height: 108%\"><strong>NO INCLUYE</strong> gastos como liberaciones, cargue, descargue, formularios, gastos en puerto, ni pago de impuestos arancelarios, etiquetado, etc. Las operaciones de importaci&oacute;n por v&iacute;a mar&iacute;tima toman en promedio cinco (5) d&iacute;as h&aacute;biles como m&aacute;ximo y tres (3) d&iacute;as h&aacute;biles como m&aacute;ximo para operaciones a&eacute;reas, contados a partir de la disponibilidad de la carga en el dep&oacute;sito de aduanas, puerto o aeropuerto, siempre y cuando contemos con toda la documentaci&oacute;n completa y correcta antes de la llegada de la mercanc&iacute;a al pa&iacute;s. Es muy importante tener en cuenta que cuando la mercanc&iacute;a requiera registro de importaci&oacute;n y vistos buenos se requiere las facturas proformas y datos de la mercanc&iacute;a para elaborarlos, obtener los permisos y vistos buenos seg&uacute;n la entidad, estos llevar&aacute;n el respectivo soporte de pago para la obtenci&oacute;n del mismo seg&uacute;n la tarifa vigente de cada entidad. Para el caso del INVIMA tiene un per&iacute;odo de cinco (5) d&iacute;as h&aacute;biles para el estudio y aprobaci&oacute;n del r&eacute;gimen de previa. Todos deben obtenerse antes de la llegada de la carga para su normal nacionalizaci&oacute;n. Es necesario tener la suficiente informaci&oacute;n sobre la mercanc&iacute;a (cat&aacute;logos, fichas t&eacute;cnicas, etc.) para su respectiva clasificaci&oacute;n arancelaria. En caso de que la mercanc&iacute;a sea parcializada por la aerol&iacute;nea- naviera y/o se deba presentar nacionalizaciones separadas y/o parciales, se cobrar&aacute;n los costos y agenciamiento generados por cada proceso de operaci&oacute;n de PROPUESTA AGENCIAMIENTO ADUANERO C&Oacute;DIGO: F &ndash; P &ndash; CO &ndash; 08 VERSION: 01 Calle 18 N. 69-69 Zona Industrial Montevideo Tel&eacute;fono: +571 4240494 Bogot&aacute; &ndash; Colombia www.cargadirecta.co nacionalizaci&oacute;n. Servicios o actividades no incluidas expresamente en este documento o sus anexos se entienden excluidos y se cobrar&aacute;n por separado.</p>\r\n<!-- p { margin-bottom: 0.25cm; direction: ltr; line-height: 115%; text-align: left; background: transparent none repeat scroll 0% 0%; }p.western { font-family: \"Calibri\", serif; }p.cjk { }p.ctl { }a:link { color: rgb(0, 0, 255); text-decoration: underline; } -->', '');
