(42, 2, 154, '30000', '', '<p><strong>LAS TARIFAS FCL NO INCLUYEN:</strong> - Uso de instalaciones portuarias - Cargue a camión - Gastos de liberación con la naviera - Báscula - Repeso - Seguro de la mercancía - Escoltas - Stand by del vehículo por demoras en el descargue - Movilización para el repeso ni uso de instalaciones o inspección física a petición de la DIAN - Bodegajes en puerto a partir del tercer día - Depósito de contenedor - Limpiezas - Drop off del contenedor - Demoras de contenedor - Devolución del contenedor vacío al puerto - Movimientos del contenedor para el descargue en la bodega o del vacío en el puerto - Descargue en destino - Instalación de gen set desde la colocación en puerto hasta su devolución y combustible para cargas refrigeradas; así mismo el servicio de energía mientras permanezca en muelle y la diferencia entre el costo del uso de instalaciones portuarias cobrado para una unidad estándar y una refrigerada. - Costo Financiero 4 x mil NOTAS: Las tarifas de los contenedores de 20” son tarifas para combinar, en caso de no poder combinar se manejará la tarifa de cupo expreso previa negociación puntual para cada despacho. El tiempo estimado de cargue para contenedores de 20’ consolidados oscila entre 48 y 72 horas hábiles posteriores a la entrega de documentos a transporte, si es sábado se cuenta a partir del siguiente día hábil. Para el caso de contenedores de 40´ el tiempo oscila entre 24 y 48 horas hábiles posteriores a la entrega de documentos a transporte, si es sábado se cuenta a partir del siguiente día hábil. En el caso de que haya desistimiento del OTM por razones ajenas a <strong>NOMBRE DE LA EMPRESA</strong> el cliente deberá asumir un valor fijo de $120.000 pesos por gastos administrativos y de gestión más gastos que se puedan generar en el mismo evento. El desistimiento puede darse cuando el cliente después de iniciado el proceso operacional ante aduana, decide no continuarla o cuando por decisión de autoridad aduanera no es aprobado la continuación de viaje.</p>', '1', '1'),
