(315, 1646, 6, 147, '0', '0', '0', '16', NULL, NULL, NULL, '16', '20', '<p><strong>CONDICIONES GENERALES APLICAN A TODOS LOS FLETES LCL</strong><strong></strong></p>\r\n<p><em>El siguiente texto es una muestra para su verificacion</em><em>:</em><em></em></p>\r\n<p>&nbsp;*Tarifas para carga general no Aplica para carga &nbsp;&nbsp;peligrosa ni extradimensionada.</p>\r\n<p>*Tarifas sujetas a cambios sin previo aviso.</p>\r\n<p>*Las Cargas con Transbordos Estan Sujetas a Conexion en el &nbsp;&nbsp;Puerto Correspondiente.</p>\r\n<p>*El Flete Internacional NO incluye seguro de la carga, en caso de requerirlo este debe ser solictado por escrito.</p>\r\n<p>*Para las cargas que tengan mas peso que volumen,se genera un recargo por densidad del 50% sobre el total del flete si por algun motivo NOMBRE DE LA EMPRESA debe emitir el HBL en destino, este &nbsp;tendria un valor de USD 25 / HBL.</p>'),
