(328, 9, 3, 197, '0', '0', '0', '700', '500', '600', '700', NULL, NULL, '<p><strong>ESTAS SON CONDICIONES GENERALES PARA FLETES FCL</strong></p>\r\n<p><em>El siguiente texto es una muestra para su verificacion</em><em>:</em><em></em></p>\r\n<p>BENEFICIOS ADICIONALES REF ( 62)</p>\r\n<p>*15 Dias libres para devolucion &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;de Contenedores</p>\r\n<p>*Exoneracion de Deposito</p>\r\n<p>*Drop Off en Bogota Sujeto a disponibilidad de &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;espacio en los patios. El costo del drop Off es de USD 150 / TEU</p>\r\n<p>*Si &nbsp;por algun motivo NOMBRE DE LA EMPRESA debe emitir el HBL en destino, este &nbsp;tendra un valor de USD 25 / HBL</p>\r\n<p>BENEFICIOS ADICIONALES REF ( 61)</p>\r\n<p>*20 Dias libres para devolucion &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;de Contenedores</p>\r\n<p>*Exoneracion &nbsp;de Deposito</p>\r\n<p>*Drop &nbsp;Off en Bogota Sujeto a disponibilidad de &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;espacio en los patios. &nbsp;El costo del drop Off es de USD 150 / TEU</p>\r\n<p>Si &nbsp;&nbsp;por algun motivo NOMBRE DE LA EMPRESA &nbsp;debe emitir el HBL en destino, este &nbsp;&nbsp;tendra un valor de USD 25 / HBL</p>'),
(329, 7, 3, 201, '0', '0', '0', '500', '500', '600', '900', NULL, NULL, '<ul>\r\n<li>\r\n<p style=\"margin-bottom: 0cm; line-height: 100%;\">IVA aplica 	19% sobre gastos en destino.</p>\r\n</li>\r\n<li>\r\n<p style=\"margin-bottom: 0cm; line-height: 100%;\">Deposito de 	Contenedor Exonerado sujeto a carta de responsabilidad.</p>\r\n</li>\r\n<li>\r\n<p style=\"margin-bottom: 0cm; line-height: 100%;\">Exoneracion del 	drop Off varia de acuerdo a la naviera y esta sujeta a espacio en 	patios de la naviera, al monento del arribo.</p>\r\n</li>\r\n<li>\r\n<p style=\"margin-bottom: 0cm; line-height: 100%;\">Dias libres de 	moras varian de acuerdo a la naviera.</p>\r\n</li>\r\n<li>\r\n<p style=\"margin-bottom: 0cm; line-height: 100%;\">Cobros por 	demoras, da&ntilde;os, limpiezas, etc de contenedor seran facturadas para 	pago de contado, contra soportes de la linea naviera.</p>\r\n</li>\r\n<li>\r\n<p style=\"margin-bottom: 0cm; line-height: 100%;\">Cargas 	cotizadas con Transbordos Estan Sujetas a Conexion en el   Puerto 	Correspondiente segun itinerario de la linea maritima.</p>\r\n</li>\r\n<li>\r\n<p style=\"margin-bottom: 0cm; line-height: 100%;\">Emision de HBL 	en destino, USD 50 / HBL.</p>\r\n</li>\r\n<li>\r\n<p style=\"margin-bottom: 0cm; line-height: 100%;\">Cambios en el 	BL sin costo hasta 24 hrs posteriores al envio del Draft, 	posteriormente cualquier cambio tendra costo de USD50.</p>\r\n</li>\r\n</ul>\r\n<!-- p { margin-bottom: 0.25cm; line-height: 115%; background: transparent none repeat scroll 0% 0%; } -->'),
