(332, 1646, 6, 204, '0', '0', '0', '16', NULL, NULL, NULL, '16', '20', '<ul>\r\n<li>\r\n<p style=\"margin-bottom: 0cm; line-height: 100%;\">IVA aplica 	19% sobre gastos en destino.</p>\r\n</li>\r\n<li>\r\n<p style=\"margin-bottom: 0cm; line-height: 100%;\">Para las cargas 	que tengan mas peso que volumen, se genera un recargo por densidad 	del 50% sobre el total del flete.</p>\r\n</li>\r\n<li>\r\n<p style=\"margin-bottom: 0cm; line-height: 100%;\">Si por algun 	motivo CARGA DIRECTA debe emitir el HBL en destino, este  tendria un 	valor de USD 50 / HBL.</p>\r\n</li>\r\n<li>\r\n<p style=\"margin-bottom: 0cm; line-height: 100%;\">Cargas 	cotizadas con Transbordos Estan Sujetas a Conexion en el   Puerto 	Correspondiente segun itinerario de la linea maritima.</p>\r\n</li>\r\n<li>\r\n<p style=\"margin-bottom: 0cm; line-height: 100%;\">La reserva esta 	sujeta a fecha de ingreso en bodega de consolidacion en origen.</p>\r\n</li>\r\n<li>\r\n<p style=\"margin-bottom: 0cm; line-height: 100%;\">Las cargas IMO 	generan recargo adicional cotizado puntualmente.</p>\r\n</li>\r\n</ul>\r\n<!-- p { margin-bottom: 0.25cm; line-height: 115%; background: transparent none repeat scroll 0% 0%; } -->');
