ado la continuación de viaje.</p>', '<p><strong>LAS TARIFAS FCL NO INCLUYEN:</strong> - Uso de instalaciones portuarias - Cargue a camión - Gastos de liberación con la naviera - Báscula - Repeso - Seguro de la mercancía - Escoltas - Stand by del vehículo por demoras en el descargue - Movilización para el repeso ni uso de instalaciones o inspección física a petición de la DIAN - Bodegajes en puerto a partir del tercer día - Depósito de contenedor - Limpiezas - Drop off del contenedor - Demoras de contenedor - Devolución del contenedor vacío al puerto - Movimientos del contenedor para el descargue en la bodega o del vacío en el puerto - Descargue en destino - Instalación de gen set desde la colocación en puerto hasta su devolución y combustible para cargas refrigeradas; así mismo el servicio de energía mientras permanezca en muelle y la diferencia entre el costo del uso de instalaciones portuarias cobrado para una unidad estándar y una refrigerada. - Costo Financiero 4 x mil NOTAS: Las tarifas de los contenedores de 20” son tarifas para combinar, en caso de no poder combinar se manejará la tarifa de cupo expreso previa negociación puntual para cada despacho. El tiempo estimado de cargue para contenedores de 20’ consolidados oscila entre 48 y 72 horas hábiles posteriores a la entrega de documentos a transporte, si es sábado se cuenta a partir del siguiente día hábil. Para el caso de contenedores de 40´ el tiempo oscila entre 24 y 48 horas hábiles posteriores a la entrega de documentos a transporte, si es sábado se cuenta a partir del siguiente día hábil. En el caso de que haya desistimiento del OTM por razones ajenas a <strong>NOMBRE DE LA EMPRESA</strong> el cliente deberá asumir un valor fijo de $120.000 pesos por gastos administrativos y de gestión más gastos que se puedan generar en el mismo evento. El desistimiento puede darse cuando el cliente después de iniciado el proceso operacional ante aduana, decide no continuarla o cuando por decisión de autoridad aduanera no es aprobado la continuación de viaje.</p>', '1', '1'),
(24, 2, 126, '195000', '<p style=\"text-align: justify;\"><span style=\"font-size: x-small;\"><span style=\"font-family: tahoma,arial,helvetica,sans-serif;\"><strong>LAS TARIFAS LCL INCLUYEN</strong>: Tres dias libres de almacenaje en puerto a partir de la desconsolidacion, </span></span><span style=\"font-size: x-small;\"><span style=\"font-family: tahoma,arial,helvetica,sans-serif;\">Poliza de ante la  DIAN tributos suspendidos, Elaboración y radicación del DTM ante la  DIAN, Elaboracion y radicacion de continuacion de viaje ante la DIAN,  Reportes diarios sobre el desarrollo de la operacion, Coordinación  Logística, Precintos de contenedor,  Cierre del transito en deposito  aduanero o zona franca.</span></span></p>\r\n<p style=\"text-align: justify;\"><br /><span style=\"font-size: x-small;\"><span style=\"font-family: tahoma,arial,helvetica,sans-serif;\"><strong>LAS TARIFAS LCL NO INLCUYEN</strong>:</span></span><span style=\"font-size: x-small;\"><span style=\"font-family: tahoma,arial,helvetica,sans-serif;\"> Gastos inherentes a la inspección fisica si la DIAN asi lo amerita, Seguro para el transporte de mercancías,, Gastos portuarios los cuales seran cobrados al costo presentando soportes respectivos, Repeso de la mercancía, Stand by de vehículos después de 24 horas de arribo al sitio de descargue, Acompañamiento vehicular o sistemas de seguridad a la carga.</span></span></p>\r\n<p style=\"text-align: justify;\">Tarifas para consolidados saliendo unicamnete de SPRB, TC BUEN y SPRC.</p>\r\n<p style=\"text-align: justify;\"><span style=\"font-size: x-small;\"><span style=\"font-family: tahoma,arial,helvetica,sans-serif;\"><br /></span></span></p>\r\n<p style=\"text-align: justify;\"><span style=\"font-size: x-small;\"><span style=\"font-family: tahoma,arial,helvetica,sans-serif;\">                                                                                 <span style=\"text-decoration: underline;\">CONDICIONES GENERALES EN OTM LCL</span></span></span></p>\r\n<p style=\"text-align: justify;\"><span style=\"font-size: x-small;\"><span style=\"font-family: tahoma,arial,helvetica,sans-serif;\">Este servicio se presta desde Sociedad Portuaria de Cartagena, Sociedad Portuaria de Buenaventura y Tcbuen a Bogota en Zona Franca Fontibon, Frecuencia semanal, Los desistimientos tienen un costo de COP$ 150.000 por documentos elaborados mas gastos portuarios, Para Mercancía General serán manejadas bajo los siguientes parámetros de seguridad, Mercancía Mayor a COP$ 150.000.000 se solicitara un escolta vehicular. El rango maximo de peso para consolidacion de carga para Otm es de 4.000 kgs, los pesos superiores se deben manejar en cupos expresos.<br /></span></span></p>\r\n<p style=\"text-align: justify;\"><span style=\"font-size: x-small;\"><span style=\"font-family: tahoma,arial,helvetica,sans-serif;\"> </span></span><span style=\"font-size: x-small;\"><span style=\"font-family: tahoma,arial,helvetica,sans-serif;\"><span style=\"font-size: x-small;\"><span style=\"font-family: tahoma,arial,helvetica,sans-serif;\"><strong>DOCUMENTACION REQUERIDA: </strong>Datos  completos  del importador ( Nit, Dirección, Teléfono, e-mail  (Contacto), Hbl Original, Copia de la factura Comercial, Copia de la  Póliza de Seguro, Copia de la Lista de empaque, Descripción en español  de la mercancia, declaracion de importacion o exportacion si se lleva a  cabo esta operacion por primera vez con Gateway solutions.</span></span></span></span></p>\r\n<p style=\"text-align: justify;\"><span style=\"font-size: x-small;\"><span style=\"font-family: tahoma,arial,helvetica,sans-serif;\"><span style=\"font-size: x-small;\"></span></span></span></p>\r\n<p style=\"text-align: justify;\"><span style=\"font-size: x-small;\"><span style=\"font-family: tahoma,arial,helvetica,sans-serif;\"><span style=\"font-size: x-small;\"><span style=\"font-family: tahoma,arial,helvetica,sans-serif;\">La Póliza del Importador deberá incluir los tributos aduaneros. El OTM no se hace responsable por el pago de tributos aduaneros a la DIAN, la póliza de tributos aduanero sólo cumple la función de garantía a la DIAN. Los pagos por tributos aduaneros deberán ser asumidos por el importador y reclamados a su compañía de seguros para ser pagados a la DIAN.</span></span></span></span></p>\r\n<p style=\"text-align: justify;\"><span style=\"font-size: x-small;\"><span style=\"font-family: tahoma,arial,helvetica,sans-serif;\"><span style=\"font-size: x-small;\"></span></span></span></p>\r\n<p style=\"text-align: justify;\"><span style=\"font-size: x-small;\">Para<span style=\"font-size: x-small;\"> efectuar la operacion de transito con terminos suspendidos es requisito  legal que el BL venga consignado en OTM, en este caso de la siguiente  manera:</span></span></p>\r\n<p style=\"text-align: left;\"><span style=\"font-size: x-small;\">TRANSPORTES 3T OTM NIT 800.209.831-5<br />DEPOSITO HABILITADO O USUARIO DE  ZONA FRANCA<br />DIRECCION DEPOSITO<br />CIUDAD DESTINO</span></p>', '<p style=', '0', '1'),
(31, 1, 143, '1452222', '<p><strong>LAS TARIFAS FCL NO INCLUYEN:</strong> - Uso de instalaciones portuarias - Cargue a camión - Gastos de liberación con la naviera - Báscula - Repeso - Seguro de la mercancía - Escoltas - Stand by del vehículo por demoras en el descargue - Movilización para el repeso ni uso de instalaciones o inspección física a petición de la DIAN - Bodegajes en puerto a partir del tercer día - Depósito de contenedor - Limpiezas - Drop off del contenedor - Demoras de contenedor - Devolución del contenedor vacío al puerto - Movimientos del contenedor para el descargue en la bodega o del vacío en el puerto - Descargue en destino - Instalación de gen set desde la colocación en puerto hasta su devolución y combustible para cargas refrigeradas; así mismo el servicio de energía mientras permanezca en muelle y la diferencia entre el costo del uso de instalaciones portuarias cobrado para una unidad estándar y una refrigerada. - Costo Financiero 4 x mil NOTAS: Las tarifas de los contenedores de 20” son tarifas para combinar, en caso de no poder combinar se manejará la tarifa de cupo expreso previa negociación puntual para cada despacho. El tiempo estimado de cargue para contenedores de 20’ consolidados oscila entre 48 y 72 horas hábiles posteriores a la entrega de documentos a transporte, si es sábado se cuenta a partir del siguiente día hábil. Para el caso de contenedores de 40´ el tiempo oscila entre 24 y 48 horas hábiles posteriores a la entrega de documentos a transporte, si es sábado se cuenta a partir del siguiente día hábil. En el caso de que haya desistimiento del OTM por razones ajenas a <strong>NOMBRE DE LA EMPRESA</strong> el cliente deberá asumir un valor fijo de $120.000 pesos por gastos administrativos y de gestión más gastos que se puedan generar en el mismo evento. El desistimiento puede darse cuando el cliente después de iniciado el proceso operacional ante aduana, decide no continuarla o cuando por decisión de autoridad aduanera no es aprobado la continuación de viaje.</p>', '<p><strong>LAS TARIFAS FCL NO INCLUYEN:</strong> - Uso de instalaciones portuarias - Cargue a camión - Gastos de liberación con la naviera - Báscula - Repeso - Seguro de la mercancía - Escoltas - Stand by del vehículo por demoras en el descargue - Movilización para el repeso ni uso de instalaciones o inspección física a petición de la DIAN - Bodegajes en puerto a partir del tercer día - Depósito de contenedor - Limpiezas - Drop off del contenedor - Demoras de contenedor - Devolución del contenedor vacío al puerto - Movimientos del contenedor para el descargue en la bodega o del vacío en el puerto - Descargue en destino - Instalación de gen set desde la colocación en puerto hasta su devolución y combustible para cargas refrigeradas; así mismo el servicio de energía mientras permanezca en muelle y la diferencia entre el costo del uso de instalaciones portuarias cobrado para una unidad estándar y una refrigerada. - Costo Financiero 4 x mil NOTAS: Las tarifas de los contenedores de 20” son tarifas para combinar, en caso de no poder combinar se manejará la tarifa de cupo expreso previa negociación puntual para cada despacho. El tiempo estimado de cargue para contenedores de 20’ consolidados oscila entre 48 y 72 horas hábiles posteriores a la entrega de documentos a transporte, si es sábado se cuenta a partir del siguiente día hábil. Para el caso de contenedores de 40´ el tiempo oscila entre 24 y 48 horas hábiles posteriores a la entrega de documentos a transporte, si es sábado se cuenta a partir del siguiente día hábil. En el caso de que haya desistimiento del OTM por razones ajenas a <strong>NOMBRE DE LA EMPRESA</strong> el cliente deberá asumir un valor fijo de $120.000 pesos por gastos administrativos y de gestión más gastos que se puedan generar en el mismo evento. El desistimiento puede darse cuando el cliente después de iniciado el proceso operacional ante aduana, decide no continuarla o cuando por decisión de autoridad aduanera