(88, 2, 171, '195000', '<p style=\"text-align: justify;\"><span style=\"font-size: x-small;\"><span style=\"font-family: tahoma,arial,helvetica,sans-serif;\"><strong>Condiciones generales y documentaci&oacute;n requerida aplica a todas las tarifas OTM LCL<br /><br />LAS TARIFAS LCL INCLUYEN</strong>: Tres dias libres de almacenaje en puerto a partir de la desconsolidacion, </span></span><span style=\"font-size: x-small;\"><span style=\"font-family: tahoma,arial,helvetica,sans-serif;\">Poliza de ante la  DIAN tributos suspendidos, Elaboraci&oacute;n y radicaci&oacute;n del DTM ante la  DIAN, Elaboracion y radicacion de continuacion de viaje ante la DIAN,  Reportes diarios sobre el desarrollo de la operacion, Coordinaci&oacute;n  Log&iacute;stica, Precintos de contenedor,&nbsp; Cierre del transito en deposito  aduanero o zona franca.</span></span></p>\r\n<p style=\"text-align: justify;\"><br /><span style=\"font-size: x-small;\"><span style=\"font-family: tahoma,arial,helvetica,sans-serif;\"><strong>LAS TARIFAS LCL NO INLCUYEN</strong>:</span></span><span style=\"font-size: x-small;\"><span style=\"font-family: tahoma,arial,helvetica,sans-serif;\"> Gastos inherentes a la inspecci&oacute;n fisica si la DIAN asi lo amerita, Seguro para el transporte de mercanc&iacute;as,, Gastos portuarios los cuales seran cobrados al costo presentando soportes respectivos, Repeso de la mercanc&iacute;a, Stand by de veh&iacute;culos despu&eacute;s de 24 horas de arribo al sitio de descargue, Acompa&ntilde;amiento vehicular o sistemas de seguridad a la carga.</span></span></p>\r\n<p style=\"text-align: justify;\">Tarifas para consolidados saliendo unicamnete de SPRB, TC BUEN y SPRC.</p>\r\n<p style=\"text-align: justify;\"><span style=\"font-size: x-small;\"><span style=\"font-family: tahoma,arial,helvetica,sans-serif;\"><br /></span></span></p>\r\n<p style=\"text-align: justify;\"><span style=\"font-size: x-small;\"><span style=\"font-family: tahoma,arial,helvetica,sans-serif;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &nbsp; &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; <span style=\"text-decoration: underline;\">CONDICIONES GENERALES EN OTM LCL</span></span></span></p>\r\n<p style=\"text-align: justify;\"><span style=\"font-size: x-small;\"><span style=\"font-family: tahoma,arial,helvetica,sans-serif;\">Este servicio se presta desde Sociedad Portuaria de Cartagena, Sociedad Portuaria de Buenaventura y Tcbuen a Bogota en Zona Franca Fontibon, Frecuencia semanal, Los desistimientos tienen un costo de COP$ 150.000 por documentos elaborados mas gastos portuarios, Para Mercanc&iacute;a General ser&aacute;n manejadas bajo los siguientes par&aacute;metros de seguridad, Mercanc&iacute;a Mayor a COP$ 150.000.000 se solicitara un escolta vehicular. El rango maximo de peso para consolidacion de carga para Otm es de 4.000 kgs, los pesos superiores se deben manejar en cupos expresos.<br /></span></span></p>\r\n<p style=\"text-align: justify;\"><span style=\"font-size: x-small;\"><span style=\"font-family: tahoma,arial,helvetica,sans-serif;\"> </span></span><span style=\"font-size: x-small;\"><span style=\"font-family: tahoma,arial,helvetica,sans-serif;\"><span style=\"font-size: x-small;\"><span style=\"font-family: tahoma,arial,helvetica,sans-serif;\"><strong>DOCUMENTACION REQUERIDA: </strong>Datos  completos&nbsp; del importador ( Nit, Direcci&oacute;n, Tel&eacute;fono, e-mail  (Contacto), Hbl Original, Copia de la factura Comercial, Copia de la  P&oacute;liza de Seguro, Copia de la Lista de empaque, Descripci&oacute;n en espa&ntilde;ol  de la mercancia, declaracion de importacion o exportacion si se lleva a  cabo esta operacion por primera vez con Gateway solutions.</span></span></span></span></p>\r\n<p style=\"text-align: justify;\"><span style=\"font-size: x-small;\"></span></p>\r\n<p style=\"text-align: justify;\"><span style=\"font-size: x-small;\"><span style=\"font-family: tahoma,arial,helvetica,sans-serif;\"><span style=\"font-size: x-small;\"><span style=\"font-family: tahoma,arial,helvetica,sans-serif;\">La P&oacute;liza del Importador deber&aacute; incluir los tributos aduaneros. El OTM no se hace responsable por el pago de tributos aduaneros a la DIAN, la p&oacute;liza de tributos aduanero s&oacute;lo cumple la funci&oacute;n de garant&iacute;a a la DIAN. Los pagos por tributos aduaneros deber&aacute;n ser asumidos por el importador y reclamados a su compa&ntilde;&iacute;a de seguros para ser pagados a la DIAN.</span></span></span></span></p>\r\n<p style=\"text-align: justify;\"><span style=\"font-size: x-small;\"></span></p>\r\n<p style=\"text-align: justify;\"><span style=\"font-size: x-small;\">Para<span style=\"font-size: x-small;\"> efectuar la operacion de transito con terminos suspendidos es requisito  legal que el BL venga consignado en OTM, en este caso de la siguiente  manera:</span></span></p>\r\n<p style=\"text-align: left;\"><span style=\"font-size: x-small;\">TRANSPORTES 3T OTM NIT 800.209.831-5<br />DEPOSITO HABILITADO O USUARIO DE  ZONA FRANCA<br />DIRECCION DEPOSITO<br />CIUDAD DESTINO</span></p>', '', '0', '0'),
(89, 1, 172, '200', '<p><strong>Condiciones generales y documentaci&oacute;n requerida aplica a todas las tarifas OTM FCL<br />LAS TARIFAS FCL NO INCLUYEN:</strong> - Uso de instalaciones portuarias - Cargue a cami&oacute;n - Gastos de liberaci&oacute;n con la naviera - B&aacute;scula - Repeso - Seguro de la mercanc&iacute;a - Escoltas - Stand by del veh&iacute;culo por demoras en el descargue - Movilizaci&oacute;n para el repeso ni uso de instalaciones o inspecci&oacute;n f&iacute;sica a petici&oacute;n de la DIAN - Bodegajes en puerto a partir del tercer d&iacute;a - Dep&oacute;sito de contenedor - Limpiezas - Drop off del contenedor - Demoras de contenedor - Devoluci&oacute;n del contenedor vac&iacute;o al puerto - Movimientos del contenedor para el descargue en la bodega o del vac&iacute;o en el puerto - Descargue en destino - Instalaci&oacute;n de gen set desde la colocaci&oacute;n en puerto hasta su devoluci&oacute;n y combustible para cargas refrigeradas; as&iacute; mismo el servicio de energ&iacute;a mientras permanezca en muelle y la diferencia entre el costo del uso de instalaciones portuarias cobrado para una unidad est&aacute;ndar y una refrigerada. - Costo Financiero 4 x mil NOTAS: Las tarifas de los contenedores de 20&rdquo; son tarifas para combinar, en caso de no poder combinar se manejar&aacute; la tarifa de cupo expreso previa negociaci&oacute;n puntual para cada despacho. El tiempo estimado de cargue para contenedores de 20&rsquo; consolidados oscila entre 48 y 72 horas h&aacute;biles posteriores a la entrega de documentos a transporte, si es s&aacute;bado se cuenta a partir del siguiente d&iacute;a h&aacute;bil. Para el caso de contenedores de 40&acute; el tiempo oscila entre 24 y 48 horas h&aacute;biles posteriores a la entrega de documentos a transporte, si es s&aacute;bado se cuenta a partir del siguiente d&iacute;a h&aacute;bil. En el caso de que haya desistimiento del OTM por razones ajenas a <strong>NOMBRE DE LA EMPRESA</strong> el cliente deber&aacute; asumir un valor fijo de $120.000 pesos por gastos administrativos y de gesti&oacute;n m&aacute;s gastos que se puedan generar en el mismo evento. El desistimiento puede darse cuando el cliente despu&eacute;s de iniciado el proceso operacional ante aduana, decide no continuarla o cuando por decisi&oacute;n de autoridad aduanera no es aprobado la continuaci&oacute;n de viaje.</p>', '', '0', '0'),
