 la siguiente  manera:</p>\r\n<p class=\"western\" style=\"margin-bottom: 0.28cm; line-height: 108%;\" align=\"center\"><span style=\"color: #263238;\"><span style=\"font-family: Arial, serif;\"><span style=\"font-size: x-small;\"><strong>CARGA DIRECTA OTM S.A. , Nit 800 157.190-8 COD 315,&nbsp;&nbsp;</strong></span></span></span></p>\r\n<p class=\"western\" style=\"margin-bottom: 0.28cm; line-height: 108%;\" align=\"center\"><span style=\"color: #263238;\"><span style=\"font-family: Arial, serif;\"><span style=\"font-size: x-small;\"><strong>NOMBRE DEL DEP&Oacute;SITO Y/O ZONA FRANCA&nbsp;&nbsp;ADUANERA AUTORIZADA,&nbsp;&nbsp;DIRECCI&Oacute;N, CIUDAD Y FRASE QUE INDIQUE MERCANCIA EN OTM O MERCANC&Iacute;A CONTINUACI&Oacute;N DE VIAJE</strong></span></span></span><span style=\"color: #263238;\"><span style=\"font-family: Arial, serif;\"><span style=\"font-size: x-small;\"><br /> b.&nbsp;&nbsp;</span></span></span><span style=\"color: #263238;\"><span style=\"font-family: Arial, serif;\"><span style=\"font-size: x-small;\"><strong>FRASE QUE INDIQUE SHIPPED ON BOARD (FECHA)</strong></span></span></span></p>\r\n<p class=\"western\" style=\"margin-bottom: 0.28cm; line-height: 108%;\">LAS TARIFAS INCLUYEN: Poliza de ante la  DIAN tributos suspendidos, Elaboraci&oacute;n y radicaci&oacute;n del DTM ante la  DIAN, Elaboracion y radicacion de continuacion de viaje ante la DIAN,  Reportes diarios sobre el desarrollo de la operacion, Coordinaci&oacute;n  Log&iacute;stica, Cierre del transito en deposito  aduanero o zona franca.</p>\r\n<p class=\"western\" style=\"margin-bottom: 0.28cm; line-height: 108%;\">LAS TARIFAS NO INCLUYEN:Uso de instalaciones portuarias  / Cargue a camion/ Gastos de liberaci&oacute;n con la naviera/ B&aacute;scula/ Repeso/ Seguro de la mercanc&iacute;a/ Escoltas, sellos o dispositivos de seguridad/ Stand by del veh&iacute;culo por demoras en el descargue/ Movilizaci&oacute;n para el repeso ni uso de instalaciones o inspecci&oacute;n f&iacute;sica a petici&oacute;n de la DIAN / POLFA/ Bodegajes en puerto a partir del tercer d&iacute;a/ Dep&oacute;sito de contenedor/ Limpiezas/ Drop off del contenedor/ Demoras de contenedor / Devoluci&oacute;n del contenedor vac&iacute;o al Puerto/ Movimientos del contenedor para el descargue en la bodega o del vac&iacute;o en el puerto Descargue en destino final.</p>\r\n<p class=\"western\" style=\"margin-bottom: 0.28cm; line-height: 108%;\">NOTAS: Las tarifas de los contenedores de 20&rdquo; son tarifas para combinar, en caso de no poder combinar se manejar&aacute; la tarifa de cupo expreso previa negociaci&oacute;n puntual para cada despacho. El tiempo estimado de cargue para contenedores de 20&rsquo; consolidados oscila entre 48 y 72 horas h&aacute;biles posteriores a la entrega de documentos a transporte, si es s&aacute;bado se cuenta a partir del siguiente d&iacute;a h&aacute;bil. Para el caso de contenedores de 40&acute; el tiempo oscila entre 24 y 48 horas h&aacute;biles posteriores a la entrega de documentos a transporte, si es s&aacute;bado se cuenta a partir del siguiente d&iacute;a h&aacute;bil. LOS TIEMPOS DE CONSOLIDACION ESTAN SUJETOS A LA SITAUCION DEL MERCADO EN EL MOMENTO DEL CARGUE.</p>\r\n<p class=\"western\" style=\"margin-bottom: 0.28cm; line-height: 108%;\">En el caso de que haya desistimiento del OTM por razones ajenas a CARGA DIRECTA el cliente deber&aacute; asumir un valor fijo de $250.000 por gastos administrativos y de gesti&oacute;n m&aacute;s gastos que se puedan generar en el mismo evento que seran facturados contra soportes.</p>\r\n<p class=\"western\" style=\"margin-bottom: 0.28cm; line-height: 108%;\">El desistimiento puede darse cuando el cliente despu&eacute;s de iniciado el proceso operacional ante aduana, decide no continuarla o cuando por decisi&oacute;n de autoridad aduanera no es aprobado la continuaci&oacute;n de viaje.</p>', '<p>SATLOCK</p>\r\n<table class=', '0', '0'),
