lor: #ff0000;\">1. 3 Tarifa &uacute;nica para 1 d&iacute;a en ruta: Nacional o Urbanos</span></p>\r\n<p>&nbsp;</p>\r\n<table class=\"tabla\" style=\"width: 70%;\" border=\"1\" cellspacing=\"0\" cellpadding=\"2\" align=\"center\">\r\n<tbody>\r\n<tr>\r\n<td colspan=\"2\"><strong>#de Viajes x mes</strong></td>\r\n<td><strong>Tarifa</strong></td>\r\n</tr>\r\n<tr>\r\n<td>1</td>\r\n<td>50</td>\r\n<td>$ 95.200</td>\r\n</tr>\r\n<tr>\r\n<td>51</td>\r\n<td>200</td>\r\n<td>$ 92.820</td>\r\n</tr>\r\n<tr>\r\n<td>201</td>\r\n<td>500</td>\r\n<td>$ 90.440</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<p>&nbsp;</p>\r\n<p>COLTRACK</p>\r\n<p><strong>TARIFA UNICA POR VIAJE &ndash; MAXIMO 5 DIAS EN RUTA.</strong></p>\r\n<p>&nbsp;</p>\r\n<table class=\"tabla\" style=\"width: 70%;\" border=\"1\" cellspacing=\"0\" cellpadding=\"2\" align=\"center\">\r\n<tbody>\r\n<tr>\r\n<td colspan=\"2\"><strong># de Viajes x mes</strong></td>\r\n<td><strong>Tarifa</strong></td>\r\n<td><strong>D&iacute;a Extra o Parqueo</strong></td>\r\n</tr>\r\n<tr>\r\n<td>1</td>\r\n<td>50</td>\r\n<td>$ 160.650</td>\r\n<td>$ 35.700</td>\r\n</tr>\r\n<tr>\r\n<td>51</td>\r\n<td>100</td>\r\n<td>$ 148.750</td>\r\n<td>$ 35.700</td>\r\n</tr>\r\n<tr>\r\n<td>101</td>\r\n<td>150</td>\r\n<td>$ 136.850</td>\r\n<td>$ 35.700</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<p><span style=\"color: #ff0000;\">1. 3 Tarifa &uacute;nica para 1 d&iacute;a en ruta: Nacional o Urbanos</span></p>\r\n<p>&nbsp;</p>\r\n<table class=\"tabla\" style=\"width: 70%;\" border=\"1\" cellspacing=\"0\" cellpadding=\"2\" align=\"center\">\r\n<tbody>\r\n<tr>\r\n<td colspan=\"2\"><strong>#de Viajes x mes</strong></td>\r\n<td><strong>Tarifa</strong></td>\r\n</tr>\r\n<tr>\r\n<td>1</td>\r\n<td>150</td>\r\n<td>$ 95.200</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<p>&nbsp;</p>\r\n<p><strong>Por favor tener en cuenta que el OTM se liquidara por W/M3, teniendo en cuenta la relaci&oacute;n&nbsp; 1-2 Peso/Volumen. Si el peso es mayor que el volumen se aplica la relaci&oacute;n 1Ton=2M3 y se&nbsp;facturara sobre el mayor.&nbsp;Ejemplo: Para una carga de 1Ton y 1M3, se multiplica la tonelada x 2 = 2CBM y se liquidara&nbsp; el servicio con base en 2CBM y Para una carga de 1.5Ton y 4M3 el resultado de la relaci&oacute;n&nbsp; es (1.5Ton x 2 = 3M3) por tanto se liquidara el servicio por el volumen de 4CBM</strong></p>\r\n<p>Costos como: Bodegajes, Alquiles de Estibas, Inspecciones, Cargues y/o todos los costos generados no incluidos en el servicio de continuaci&oacute;n de viaje ser&aacute;n facturados al costo. IMPORTANTE: Nuestro servicio de OTM Consolidado se presta en Veh&iacute;culos TURBO y SENCILLO; si la mercanc&iacute;a requiere usar un Contenedor (20&rsquo; y/o 40&rsquo;) para Consolidar, se debe solicitar confirmaci&oacute;n de Tarifa nuevamente, ya que el valor del Flete OTM presentar&aacute; incrementosdebido a estos manejos especiales.</p>\r\n<p><strong>Notas</strong>:</p>\r\n<ul>\r\n<li>\r\n<p>El servicio LCL en OTM est&aacute; sujeto a consolidado, en el caso de no contar con carga suficiente, se informar&aacute; al cliente para que autorice un cupo completo, en caso de no<br />contar con autorizaci&oacute;n por parte del cliente y no             se pueda continuar con el proceso<br />por vencimiento de t&eacute;rminos, se facturara el desestimiento de la operaci&oacute;n m&aacute;s los<br />costos generados en puerto por tanto los cargos de nacionalizaci&oacute;n, multas, etc. ser&aacute;n             asumidos por el cliente.</p>\r\n</li>\r\n<li>\r\n<p>No consolidamos carga en Muelles el Bosque.</p>\r\n</li>\r\n<li>\r\n<p>El servicio LCL por el puerto de Aguadulce est&aacute; sujeto a consolidado, en caso de no contar con carga suficiente se deber&aacute; contratar cupo completo.</p>\r\n</li>\r\n<li>\r\n<p>Toda Carga cuyo peso sea superior a 4 Toneladas debe ser manejada como Expreso, las tarifas deben ser consultadas caso a caso.</p>\r\n</li>\r\n<li>\r\n<p>Toda carga cuyo peso sea superior a 8 Toneladas, deber&aacute; ser manejada en contenedor y su valor debe ser consultado caso a caso.</p>\r\n</li>\r\n<li>\r\n<p>Toda carga cuyas medidas sea superiores a 1.9Mts de Alto o 4.5 Mts de Largo tendr&aacute;n concepto de extra dimensi&oacute;n y su valor debe ser consultado caso a caso. Por otra<br />parte, el ancho m&aacute;ximo a manejar en Turbo y Sencillo es             de 2.2 Mts.</p>\r\n</li>\r\n<li>\r\n<p>Si la carga es NO Remontable se debe consultar el valor y/o aceptaci&oacute;n del manejo<br />caso a caso con detalles de la carga.</p>\r\n</li>\r\n<li>\r\n<p>Cuando la mercanc&iacute;a son Telas se debe adicionar: USD 25 al REPESO.<br />En caso de desistimiento de la operaci&oacute;n de continuaci&oacute;n de viaje posterior a la<br />presentaci&oacute;n de documentos ante la DIAN por cualquier motivo             se cobrar&aacute; un<br />manejo de COP$250.000 m&aacute;s los costos portuarios generados, si el desistimiento<br />de la operaci&oacute;n se produce por inspecci&oacute;n DIAN se cobrar&aacute;n COP$300.000 m&aacute;s los<br />costos portuarios             generados.</p>\r\n</li>\r\n<li>\r\n<p>En caso de cancelar el servicio con MSL despu&eacute;s de presentada la documentaci&oacute;n<br />ante DIAN y el OTM sea aprobado, se cobrar&aacute; una presentaci&oacute;n de COP$250.000 y<br />gastos generados al costo, adicionalmente un flete muerto             del 50% sobre el valor<br />ofertado por espacio no utilizado.</p>\r\n</li>\r\n<li>\r\n<p>Las tarifas se mantienen en condiciones normales, en caso de presentarse<br />temporada invernal o casos fortuitos de fuerza mayor como derrumbes o desv&iacute;os,<br />se informar&aacute;n y facturar&aacute;n los incrementos que haya a lugar.</p>\r\n</li>\r\n<li>\r\n<p>La solicitud de documentos la realizar&aacute; el Dpto. de OTM.</p>\r\n</li>\r\n</ul>\r\n<p>&nbsp;</p>\r\n<p><strong>REQUISITOS INDISPENSABLE PARA EL MANEJO DE LA CONTINUACION DE VIAJE (OTM)</strong>(Esta debe ser presentada 3 d&iacute;as antes del arribo de la MN)</p>\r\n<ul>\r\n<li>\r\n<p>H/BL original liberado</p>\r\n</li>\r\n<li>\r\n<p>Copia del M/BL master liberado.</p>\r\n</li>\r\n<li>\r\n<p>Copia de la factura comercial acorde a los art&iacute;culos 187 y 188 de la resoluci&oacute;n 4240/00.</p>\r\n</li>\r\n<li>\r\n<p>Copia lista de empaque.</p>\r\n</li>\r\n<li>\r\n<p>Descripci&oacute;n de la carga en espa&ntilde;ol por escrito. (Resoluci&oacute;n 0178 de junio 13 de 2012).<br />P&oacute;liza de seguro (que mencione cobertura, restricciones y vigencia).</p>\r\n</li>\r\n<li>\r\n<p>Posici&oacute;n Arancelaria.</p>\r\n</li>\r\n<li>\r\n<p>Copia del Rut.</p>\r\n</li>\r\n<li>\r\n<p>Declaraci&oacute;n de Importaci&oacute;n Anterior / Resol 2820/11.</p>\r\n</li>\r\n<li>\r\n<p>Vistos Buenos y Resoluci&oacute;n ICA o INVIMA seg&uacute;n corresponda.</p>\r\n</li>\r\n<li>\r\n<p>Licencia de Importaci&oacute;n (&Uacute;nicamente para mercanc&iacute;a usada).</p>\r\n</li>\r\n</ul>\r\n<p>&nbsp;</p>\r\n<p><strong>LA CONTINUACION DE VIAJE INCLUYE:</strong></p>\r\n<ul>\r\n<li>\r\n<p>Transporte Terrestre</p>\r\n</li>\r\n<li>\r\n<p>Reportes operativos en puerto y en carretera</p>\r\n</li>\r\n<li>\r\n<p>Formularios OTM</p>\r\n</li>\r\n<li>\r\n<p>Presentaci&oacute;n y aprobaci&oacute;n de continuaci&oacute;n de viaje</p>\r\n</li>\r\n<li>\r\n<p>Cierre de continuaci&oacute;n de viaje en destino</p>\r\n</li>\r\n<li>\r\n<p>Precintos a contenedor y /o furg&oacute;n</p>\r\n</li>\r\n<li>\r\n<p>Coordinaci&oacute;n log&iacute;stica</p>\r\n</li>\r\n</ul>\r\n<p><br /><strong>LA CONTINUACION DE VIAJE NO INCLUYE:</strong></p>\r\n<ul>\r\n<li>\r\n<p>Bodegajes</p>\r\n</li>\r\n<li>\r\n<p>Cargues o Descargues de Mercanc&iacute;a o Contenedores</p>\r\n</li>\r\n<li>\r\n<p>Bodegajes en Zona Franca</p>\r\n</li>\r\n<li>\r\n<p>Movilizaci&oacute;n para inspecci&oacute;n de mercanc&iacute;as</p>\r\n</li>\r\n<li>\r\n<p>Movilizaci&oacute;n de la carga para repeso</p>\r\n</li>\r\n<li>\r\n<p>Cancelaci&oacute;n de fletes mar&iacute;timos, manejos, portuarios y liberaci&oacute;n de BL&acute;S</p>\r\n</li>\r\n<li>\r\n<p>Escolta, Acompa&ntilde;amiento y/o dispositivo satelital en el trayecto terrestre</p>\r\n</li>\r\n<li>\r\n<p>Seguro de transporte terrestre para la mercanc&iacute;a a nivel nacional</p>\r\n</li>\r\n<li>\r\n<p>Stand by despu&eacute;s de 12 Horas</p>\r\n</li>\r\n<li>\r\n<p>Formularios adicionales</p>\r\n</li>\r\n<li>\r\n<p>Costos de Inspecci&oacute;n con DIAN, Polic&iacute;a Fiscal y Aduanera, ICA e INVIMA</p>\r\n</li>\r\n<li>\r\n<p>Alquiler de estibas</p>\r\n</li>\r\n<li>\r\n<p>Pago de servicio de arrume de mercanc&iacute;a</p>\r\n</li>\r\n</ul>\r\n<p><strong>ACOMPA&Ntilde;AMIENTOS</strong>: Se requerir&aacute; acompa&ntilde;amiento para toda mercanc&iacute;a que supere COP$150.000.000 millones de pesos y/o sean mercanc&iacute;as de alto riesgo o si es susceptible de robo (Ver listado de mercanc&iacute;as del     alto riesgo) Y/O las condiciones de seguridad p&uacute;blica al momento del despacho lo causen (paros, guerrilla, inseguridad en carreteras etc.).</p>\r\n<p>***En algunos casos se solicitar&aacute; escolta y/o dispositivo satelital, el costo ser&aacute;     prorrateado con los clientes del consolidado seg&uacute;n el valor y perfil de las cargas a manejar por<br />despacho esto con el fin de incrementar la seguridad en el transporte de mercanc&iacute;as en OTM.</p>\r\n<p>***Si la mercanc&iacute;a supera COP$ 300 millones, la diferencia debe ser reasegurada, el valor del reaseguro se informa caso a caso. Por otra parte, debe viajar con acompa&ntilde;amiento vehicular y dispositivo satelital.</p>\r\n<p><strong>MERCANCIAS CONSIDERADAS DE ALTO RIESGO EN OTM</strong>:</p>\r\n<p>Alimentos enlatados, Leche en polvo, margarinas u aceites, combustibles, Arroz, Az&uacute;car, caf&eacute; de exportaci&oacute;n y caf&eacute; pergamino, Licores y Vinos, cerveza en lata, cigarrillos, Electrodom&eacute;sticos en general, sus partes componentes o repuestos para los mismos, equipos de comunicaci&oacute;n sus partes, componentes o repuestos para los mismos, equipos de procesamiento de datos (computadores) sus partes, componentes y repuestos para los mismos, agroqu&iacute;micos(fungicidas e insecticidas) abonos y fertilizantes , Veh&iacute;culos a motor, material CKD, sus partes accesorios o repuestos para los mismos, llantas y neum&aacute;ticos, Calzado en general textiles y confecciones, hilos, hilazas y fibras, Acero, hierro, Zinc, cobre cualquier presentaci&oacute;n, polipropileno, polietileno de alta densidad (en bruto), Jugueter&iacute;a importada, precursores qu&iacute;micos, instrumentos quir&uacute;rgicos.</p>\r\n<p>La p&oacute;liza de seguro del transportador opera v&iacute;a subrogaci&oacute;n amparando responsabilidad civil, por consiguiente, para realizar cualquier transporte de mercanc&iacute;a es de completa obligatoriedad que el cliente posea una p&oacute;liza     de seguro contra todo riesgo 3. El cliente solicitante del servicio ser&aacute; responsable por los perjuicios que ocasionan la informaci&oacute;n incorrecta de los documentos (volumen, n&uacute;mero de piezas, identificaci&oacute;n gen&eacute;rica     de las mercanc&iacute;as etc.) y asumir&aacute; las multas o sanciones aduaneras originadas por la informaci&oacute;n err&oacute;nea 4. Bajo la responsabilidad del importador quedan los gastos de documentaci&oacute;n, nacionalizaci&oacute;n de la mercanc&iacute;a, bodegajes, retiro de la carga y movimientos en Zona Franca. 5. La consolidaci&oacute;n de OTM se har&aacute; una vez por semana en Cartagena y Buenaventura dependiendo el volumen de carga, haciendo cierre los mi&eacute;rcoles y despachando los s&aacute;bados. Las cargas que no est&eacute;n listas los mi&eacute;rcoles de esa semana quedaran programadas para el consolidado de la siguiente semana si dado el caso no tenemos suficiente carga para consolidar nos reservamos el derecho a no realizar el tr&aacute;nsito, informando oportunamente al cliente que carga se quedar&aacute; en puerto para ser nacionalizada en puerto o en su defecto que nos autoricen a manejar un cami&oacute;n exclusivo asumiendo la totalidad     del costo en ese movimiento. 6. El servicio de OTM se prestar&aacute; mediante solicitud de servicio adjunta y contra la prestaci&oacute;n de los documentos antes mencionados. 7. Si se requiere preinspecci&oacute;n f&iacute;sica por parte     de la DIAN a las cargas en OTM este ser&aacute; facturado a ustedes con soportes oficiales. 8. El t&eacute;rmino para el retiro de cargas de puerto ser&aacute; de cinco (5) d&iacute;as h&aacute;biles a partir de la finalizaci&oacute;n, de acuerdo a regulaci&oacute;n vigente en materia de tr&aacute;nsitos aduaneros, por tal raz&oacute;n se deben agilizar todos los procesos necesarios para la oportuna aprobaci&oacute;n por<br />parte de la DIAN y liberaci&oacute;n de cargas, con el &uacute;nico fin de tener el tiempo requerido (M&iacute;nimo 24H - M&aacute;ximo 48H) para la gesti&oacute;n log&iacute;stica de asignaci&oacute;n y cargue a cami&oacute;n durante el t&eacute;rmino en menci&oacute;n y evitar vencimientos y por ende cambios de modalidad. 9. Para proceder con desistimiento del tr&aacute;nsito y el endoso del documento de transporte, el cliente deber&aacute; enviar carta de solicitud, debidamente autenticada, y con anexo certificado de existencia y representaci&oacute;n legal y RUT. 10. Los fletes indicados est&aacute;n basados en tarifas actuales sujetas a cambios. 11. Los valores en d&oacute;lares se liquidar&aacute;n en pesos con la TRM del d&iacute;a mas COP$30 Pesos. 12. Nuestra responsabilidad contractual no exceder&aacute; en ning&uacute;n caso, las limitaciones estipuladas en las normativas oficiales vigentes para el transporte mar&iacute;timo (Ver dorso BL). 13. Para todos los casos solo se aseguran cargas con solicitud de seguro por escrito y que no llevan m&aacute;s de 15 d&iacute;as de tiempo de tr&aacute;nsito, En caso de siniestro la informaci&oacute;n debe ser inmediata, solo se aceptan reclamaciones m&aacute;ximo 5 d&iacute;as despu&eacute;s del siniestro. <strong>CARGA DIRECTA OTM SA</strong> se limita a las cl&aacute;usulas legales estipuladas por las empresas participantes en cada contrato de transporte.</p>\r\n<p>*Para pago de liberacion y gastos portuarios aplica 4x1.000.</p>', '', '0', '1'),
(125, 1, 194, '200', '<p><strong>Condiciones generales y documentaci&oacute;n requerida aplica a todas las tarifas OTM FCL<br />LAS TARIFAS FCL NO INCLUYEN:</strong> - Uso de instalaciones portuarias - Cargue a cami&oacute;n - Gastos de liberaci&oacute;n con la naviera - B&aacute;scula - Repeso - Seguro de la mercanc&iacute;a - Escoltas - Stand by del veh&iacute;culo por demoras en el descargue - Movilizaci&oacute;n para el repeso ni uso de instalaciones o inspecci&oacute;n f&iacute;sica a petici&oacute;n de la DIAN - Bodegajes en puerto a partir del tercer d&iacute;a - Dep&oacute;sito de contenedor - Limpiezas - Drop off del contenedor - Demoras de contenedor - Devoluci&oacute;n del contenedor vac&iacute;o al puerto - Movimientos del contenedor para el descargue en la bodega o del vac&iacute;o en el puerto - Descargue en destino - Instalaci&oacute;n de gen set desde la colocaci&oacute;n en puerto hasta su devoluci&oacute;n y combustible para cargas refrigeradas; as&iacute; mismo el servicio de energ&iacute;a mientras permanezca en muelle y la diferencia entre el costo del uso de instalaciones portuarias cobrado para una unidad est&aacute;ndar y una refrigerada. - Costo Financiero 4 x mil NOTAS: Las tarifas de los contenedores de 20&rdquo; son tarifas para combinar, en caso de no poder combinar se manejar&aacute; la tarifa de cupo expreso previa negociaci&oacute;n puntual para cada despacho. El tiempo estimado de cargue para contenedores de 20&rsquo; consolidados oscila entre 48 y 72 horas h&aacute;biles posteriores a la entrega de documentos a transporte, si es s&aacute;bado se cuenta a partir del siguiente d&iacute;a h&aacute;bil. Para el caso de contenedores de 40&acute; el tiempo oscila entre 24 y 48 horas h&aacute;biles posteriores a la entrega de documentos a transporte, si es s&aacute;bado se cuenta a partir del siguiente d&iacute;a h&aacute;bil. En el caso de que haya desistimiento del OTM por razones ajenas a <strong>NOMBRE DE LA EMPRESA</strong> el cliente deber&aacute; asumir un valor fijo de $120.000 pesos por gastos administrativos y de gesti&oacute;n m&aacute;s gastos que se puedan generar en el mismo evento. El desistimiento puede darse cuando el cliente despu&eacute;s de iniciado el proceso operacional ante aduana, decide no continuarla o cuando por decisi&oacute;n de autoridad aduanera no es aprobado la continuaci&oacute;n de viaje.</p>', '', '1', '1');
