 sábado se cuenta a partir del siguiente día hábil. Para el caso de contenedores de 40´ el tiempo oscila entre 24 y 48 horas hábiles posteriores a la entrega de documentos a transporte, si es sábado se cuenta a partir del siguiente día hábil. En el caso de que haya desistimiento del OTM por razones ajenas a <strong>NOMBRE DE LA EMPRESA</strong> el cliente deberá asumir un valor fijo de $120.000 pesos por gastos administrativos y de gestión más gastos que se puedan generar en el mismo evento. El desistimiento puede darse cuando el cliente después de iniciado el proceso operacional ante aduana, decide no continuarla o cuando por decisión de autoridad aduanera no es aprobado la continuación de viaje.</p>', '1', '1'),
