(74, 2, 201, '390', '<p>SATLOCK</p>\r\n<table class=\"tabla\" style=\"width: 70%;\" border=\"1\" cellspacing=\"0\" cellpadding=\"2\" align=\"center\">\r\n<tbody>\r\n<tr>\r\n<td><strong>SERVICIO<br />CONTROL ELECTRONICO DE CARGA</strong></td>\r\n<td><strong>Unidad Cobro </strong></td>\r\n<td><strong>Tarifa Unica x Unidad</strong></td>\r\n</tr>\r\n<tr>\r\n<td>Control Electr&oacute;nico de Contenedores de Importaci&oacute;n desde Cartagena (SPRCTG, MUELLES EL BOSQUE Y CONTECAR desde la puerta de salida del contenedor de puerto y/o Buenaventura (SPIA, SPRBUN Y TECBUEN desde la zona DTA antes de la salida del contenedor al puerto) con destino a ciudades principales Colombia.</td>\r\n<td>CONTENEDOR / FURGON CONTROLADO</td>\r\n<td>$ 154.700</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<p>&nbsp;</p>\r\n<p>PROTEKTO</p>\r\n<table class=\"tabla\" style=\"width: 70%;\" border=\"1\" cellspacing=\"0\" cellpadding=\"2\" align=\"center\">\r\n<tbody>\r\n<tr>\r\n<td colspan=\"2\"><strong>#de Viajes x mes</strong></td>\r\n<td><strong>Tarifa</strong></td>\r\n<td><strong>D&iacute;a Extra o Parqueo</strong></td>\r\n<td><strong>Combo con equipo adicional Esp&iacute;a x gesti&oacute;n en eventos de alto Riesgo </strong></td>\r\n<td><strong>Combo con equipo adicional Esp&iacute;a x gesti&oacute;n constante en ruta </strong></td>\r\n</tr>\r\n<tr>\r\n<td>1</td>\r\n<td>25</td>\r\n<td>$ 178.381</td>\r\n<td>35.700</td>\r\n<td>Principal + 47.600</td>\r\n<td>Principal + 89.191</td>\r\n</tr>\r\n<tr>\r\n<td>26</td>\r\n<td>50</td>\r\n<td>$ 166.481</td>\r\n<td>33.320</td>\r\n<td>Principal + 47.600</td>\r\n<td>Principal + 89.191</td>\r\n</tr>\r\n<tr>\r\n<td>51</td>\r\n<td>100</td>\r\n<td>$ 154.581</td>\r\n<td>30.940</td>\r\n<td>Principal + 47.600</td>\r\n<td>Principal + 89.191</td>\r\n</tr>\r\n<tr>\r\n<td>101</td>\r\n<td>200</td>\r\n<td>$ 141.610</td>\r\n<td>28.560</td>\r\n<td>Principal + 47.600</td>\r\n<td>Principal + 89.191</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<p>&nbsp;</p>\r\n<p><span style=\"color: #ff0000;\">1. 3 Tarifa &uacute;nica para 1 d&iacute;a en ruta: Nacional o Urbanos</span></p>\r\n<p>&nbsp;</p>\r\n<table class=\"tabla\" style=\"width: 70%;\" border=\"1\" cellspacing=\"0\" cellpadding=\"2\" align=\"center\">\r\n<tbody>\r\n<tr>\r\n<td colspan=\"2\"><strong>#de Viajes x mes</strong></td>\r\n<td><strong>Tarifa</strong></td>\r\n</tr>\r\n<tr>\r\n<td>1</td>\r\n<td>50</td>\r\n<td>$ 95.200</td>\r\n</tr>\r\n<tr>\r\n<td>51</td>\r\n<td>200</td>\r\n<td>$ 92.820</td>\r\n</tr>\r\n<tr>\r\n<td>201</td>\r\n<td>500</td>\r\n<td>$ 90.440</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<p>&nbsp;</p>\r\n<p>COLTRACK</p>\r\n<p><strong>TARIFA UNICA POR VIAJE &ndash; MAXIMO 5 DIAS EN RUTA.</strong></p>\r\n<p>&nbsp;</p>\r\n<table class=\"tabla\" style=\"width: 70%;\" border=\"1\" cellspacing=\"0\" cellpadding=\"2\" align=\"center\">\r\n<tbody>\r\n<tr>\r\n<td colspan=\"2\"><strong># de Viajes x mes</strong></td>\r\n<td><strong>Tarifa</strong></td>\r\n<td><strong>D&iacute;a Extra o Parqueo</strong></td>\r\n</tr>\r\n<tr>\r\n<td>1</td>\r\n<td>50</td>\r\n<td>$ 160.650</td>\r\n<td>$ 35.700</td>\r\n</tr>\r\n<tr>\r\n<td>51</td>\r\n<td>100</td>\r\n<td>$ 148.750</td>\r\n<td>$ 35.700</td>\r\n</tr>\r\n<tr>\r\n<td>101</td>\r\n<td>150</td>\r\n<td>$ 136.850</td>\r\n<td>$ 35.700</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<p><span style=\"color: #ff0000;\">1. 3 Tarifa &uacute;nica para 1 d&iacute;a en ruta: Nacional o Urbanos</span></p>\r\n<p>&nbsp;</p>\r\n<table class=\"tabla\" style=\"width: 70%;\" border=\"1\" cellspacing=\"0\" cellpadding=\"2\" align=\"center\">\r\n<tbody>\r\n<tr>\r\n<td colspan=\"2\"><strong>#de Viajes x mes</strong></td>\r\n<td><strong>Tarifa</strong></td>\r\n</tr>\r\n<tr>\r\n<td>1</td>\r\n<td>150</td>\r\n<td>$ 95.200</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<p>&nbsp;</p>\r\n<p class=\"western\" style=\"margin-bottom: 0.28cm; line-height: 108%;\">Tarifa libre de cargues y descargues Tarifa no incluye seguro La mercanc&iacute;a debe estar asegurada Tarifa incluye el peso de la tara del contenedor Tarifas sujetas a variaci&oacute;n por situaciones ajenas al transportador derivadas de paros, huelgas o casos fortuitos que terminen afectando los niveles de flete en el momento del cargue. NOTAS ESPECIALES DE ACOMPA&Ntilde;AMIENTOS REQUERIDOS: La estructura de seguridad que brinda la compa&ntilde;&iacute;a para el manejo de cargas, se rige bajo las cl&aacute;usulas de la aseguradora de tal modo que se cumplan los requisitos exigidos para garantizar y minimizar el riesgo en el transporte de las mercanc&iacute;as. Para mercanc&iacute;as catalogadas de Alto Riesgo (Ver listado siguiente) nuestra p&oacute;liza exige acompa&ntilde;amiento vehicular para aquellas que lleguen o superen el valor de $ 150 millones, o que por su naturaleza misma sea necesario el acompa&ntilde;amiento sin importar el valor, previo an&aacute;lisis a las cl&aacute;usulas de la p&oacute;liza del cliente. MERCANC&Iacute;A DE ALTO RIESGO: Son consideradas mercanc&iacute;as de alto riesgo aquellas que por su naturaleza pueden ser comercializadas o reducidas f&aacute;cilmente y por esta misma raz&oacute;n deber&aacute;n siempre tener acompa&ntilde;amiento vehicular, a continuaci&oacute;n una relaci&oacute;n de las mismas: &gt; Electrodom&eacute;sticos en general &gt; Equipos de procesamiento de datos (computadores) y sus partes &gt; Llantas y neum&aacute;ticos &gt; Productos biom&eacute;dicos &gt; Tel&eacute;fonos celulares o equivalentes &gt; Juegos de video, software de videos &gt; Perfumes y cosm&eacute;ticos en general &gt; Pieles &gt; Licores &gt; Alimentos enlatados, leche en polvo &gt; Cigarrillos &gt; Productos farmac&eacute;uticos y veterinarios &gt; Repuestos automotores y CKD &gt; Polipropileno en bruto &gt; Calzado, textiles y confecciones &gt; Cobre en cualquier presentaci&oacute;n &gt; Veh&iacute;culos de cualquier clase, botes y aviones &gt; Acero, hierro, zinc en cualquier presentaci&oacute;n &gt; Agroqu&iacute;micos &gt; Cervezas &gt; Hilos, hilazas y fibras textiles &gt; Jugueter&iacute;a &gt; Art&iacute;culos de ferreter&iacute;a &gt; Bater&iacute;as / Para mercanc&iacute;as que no est&eacute;n catalogadas como Alto riesgo, nuestra p&oacute;liza exige acompa&ntilde;amiento vehicular para aquellas que superen el valor de $ 250 millones, o que por su naturaleza misma sea necesario el acompa&ntilde;amiento sin importar el valor de acuerdo a las cl&aacute;usulas de la p&oacute;liza del cliente. Como medida alterna para algunas mercanc&iacute;as que su valor no sea tan alto, pero su naturaleza sea de alto riesgo en conjunto con el cliente y cumpliendo con las cl&aacute;usulas de la aseguradora, se podr&aacute; hacer uso del Sello satelital como medida de seguridad.</p>', '<p>SATLOCK</p>\r\n<table class=', '', ''),
