ara del contenedor Tarifas sujetas a variaci&oacute;n por situaciones ajenas al transportador derivadas de paros, huelgas o casos fortuitos que terminen afectando los niveles de flete en el momento del cargue. NOTAS ESPECIALES DE ACOMPA&Ntilde;AMIENTOS REQUERIDOS: La estructura de seguridad que brinda la compa&ntilde;&iacute;a para el manejo de cargas, se rige bajo las cl&aacute;usulas de la aseguradora de tal modo que se cumplan los requisitos exigidos para garantizar y minimizar el riesgo en el transporte de las mercanc&iacute;as. Para mercanc&iacute;as catalogadas de Alto Riesgo (Ver listado siguiente) nuestra p&oacute;liza exige acompa&ntilde;amiento vehicular para aquellas que lleguen o superen el valor de $ 150 millones, o que por su naturaleza misma sea necesario el acompa&ntilde;amiento sin importar el valor, previo an&aacute;lisis a las cl&aacute;usulas de la p&oacute;liza del cliente. MERCANC&Iacute;A DE ALTO RIESGO: Son consideradas mercanc&iacute;as de alto riesgo aquellas que por su naturaleza pueden ser comercializadas o reducidas f&aacute;cilmente y por esta misma raz&oacute;n deber&aacute;n siempre tener acompa&ntilde;amiento vehicular, a continuaci&oacute;n una relaci&oacute;n de las mismas: &gt; Electrodom&eacute;sticos en general &gt; Equipos de procesamiento de datos (computadores) y sus partes &gt; Llantas y neum&aacute;ticos &gt; Productos biom&eacute;dicos &gt; Tel&eacute;fonos celulares o equivalentes &gt; Juegos de video, software de videos &gt; Perfumes y cosm&eacute;ticos en general &gt; Pieles &gt; Licores &gt; Alimentos enlatados, leche en polvo &gt; Cigarrillos &gt; Productos farmac&eacute;uticos y veterinarios &gt; Repuestos automotores y CKD &gt; Polipropileno en bruto &gt; Calzado, textiles y confecciones &gt; Cobre en cualquier presentaci&oacute;n &gt; Veh&iacute;culos de cualquier clase, botes y aviones &gt; Acero, hierro, zinc en cualquier presentaci&oacute;n &gt; Agroqu&iacute;micos &gt; Cervezas &gt; Hilos, hilazas y fibras textiles &gt; Jugueter&iacute;a &gt; Art&iacute;culos de ferreter&iacute;a &gt; Bater&iacute;as / Para mercanc&iacute;as que no est&eacute;n catalogadas como Alto riesgo, nuestra p&oacute;liza exige acompa&ntilde;amiento vehicular para aquellas que superen el valor de $ 250 millones, o que por su naturaleza misma sea necesario el acompa&ntilde;amiento sin importar el valor de acuerdo a las cl&aacute;usulas de la p&oacute;liza del cliente. Como medida alterna para algunas mercanc&iacute;as que su valor no sea tan alto, pero su naturaleza sea de alto riesgo en conjunto con el cliente y cumpliendo con las cl&aacute;usulas de la aseguradora, se podr&aacute; hacer uso del Sello satelital como medida de seguridad.</p>', '', '', '1'),
