(110, 69, 0, 'maritimo', '2019-07-17', '15:09:20', '<div id=\'nuevoEstado\'>\r\n<div id=\'nuevoEstado\'>Estimado cliente</div>\r\n<div>&nbsp;</div>\r\n<div>Informo que nuestro agente nos prealerto una nueva carga para ustedes con los detalles que aparecen en el encabezado de este mensaj.</div>\r\n<div>&nbsp;</div>\r\n<div>Nuestra oficina en origen est&aacute; trabajando junto con la l&iacute;nea naviera para tener espacio para este despacho y nos informara una vez contemos con el prebooking de la carga.</div>\r\n<div>&nbsp;</div>\r\n<div>En cuanto tenga detalles de booking completos, lo notificare de inmediato.</div>\r\n<div>&nbsp;</div>\r\n<div>Cordial Saludo,</div>\r\n</div>'),
(111, 70, 0, 'maritimo', '2019-07-17', '15:28:43', '<div id=\'nuevoEstado\'>\r\n<div id=\'nuevoEstado\'>Estimado cliente</div>\r\n<div>Adjuntamos certificaci&oacute;n de fletes y seguro (si aplica) correspondiente a su embarque, cualquier duda con mucho gusto estaremos atentos a solucionarla</div>\r\n<div>&nbsp;</div>\r\n<div>Cordial Saludo</div>\r\n</div>'),
