INSERT INTO `parametros` (`idparametro`, `nombre`, `valor`) VALUES
(1, 'texto_presentacion', '<p>KIGEN  se complace en presentar la oferta de servicios logísticos de importacion para mercancia no peligrosa ni extra dimensionada, de acuerdo con la informacion suministrada por ustedes asi:</p>\r\n'),
(2, 'texto_condiciones', '<p>Condiciones Generales De la oferta, lo encontraran en archivo adjunto</p>\r\n<p>Nota: Una vez recibida la instruccion por parte del cliente, KIGEN dara por aceptada la presente cotizacion y sus respectivas condiciones</p>\r\n<p>Cotización.</p>'),
(3, 'texto_pie_de_pagina', '<p> Bogotá, Colombia.</p>'),
(4, 'nombre_archivo_imprimir', 'Cotizacion {file_name} Kigen'),
(5, 'exportar_word_tamano_fuente', '7'),
(6, 'exportar_word_fuente', 'Tahoma'),
(7, 'condiciones_otm_fcl', '<p><strong>Condiciones generales y documentaci&oacute;n requerida aplica a todas las tarifas OTM FCL<br />LAS TARIFAS FCL NO INCLUYEN:</strong> - Uso de instalaciones portuarias - Cargue a cami&oacute;n - Gastos de liberaci&oacute;n con la naviera - B&aacute;scula - Repeso - Seguro de la mercanc&iacute;a - Escoltas - Stand by del veh&iacute;culo por demoras en el descargue - Movilizaci&oacute;n para el repeso ni uso de instalaciones o inspecci&oacute;n f&iacute;sica a petici&oacute;n de la DIAN - Bodegajes en puerto a partir del tercer d&iacute;a - Dep&oacute;sito de contenedor - Limpiezas - Drop off del contenedor - Demoras de contenedor - Devoluci&oacute;n del contenedor vac&iacute;o al puerto - Movimientos del contenedor para el descargue en la bodega o del vac&iacute;o en el puerto - Descargue en destino - Instalaci&oacute;n de gen set desde la colocaci&oacute;n en puerto hasta su devoluci&oacute;n y combustible para cargas refrigeradas; as&iacute; mismo el servicio de energ&iacute;a mientras permanezca en muelle y la diferencia entre el costo del uso de instalaciones portuarias cobrado para una unidad est&aacute;ndar y una refrigerada. - Costo Financiero 4 x mil NOTAS: Las tarifas de los contenedores de 20&rdquo; son tarifas para combinar, en caso de no poder combinar se manejar&aacute; la tarifa de cupo expreso previa negociaci&oacute;n puntual para cada despacho. El tiempo estimado de cargue para contenedores de 20&rsquo; consolidados oscila entre 48 y 72 horas h&aacute;biles posteriores a la entrega de documentos a transporte, si es s&aacute;bado se cuenta a partir del siguiente d&iacute;a h&aacute;bil. Para el caso de contenedores de 40&acute; el tiempo oscila entre 24 y 48 horas h&aacute;biles posteriores a la entrega de documentos a transporte, si es s&aacute;bado se cuenta a partir del siguiente d&iacute;a h&aacute;bil. En el caso de que haya desistimiento del OTM por razones ajenas a <strong>NOMBRE DE LA EMPRESA</strong> el cliente deber&aacute; asumir un valor fijo de $120.000 pesos por gastos administrativos y de gesti&oacute;n m&aacute;s gastos que se puedan generar en el mismo evento. El desistimiento puede darse cuando el cliente despu&eacute;s de iniciado el proceso operacional ante aduana, decide no continuarla o cuando por decisi&oacute;n de autoridad aduanera no es aprobado la continuaci&oacute;n de viaje.</p>'),
