/table> <p>&nbsp;</p> <table class=\"tabla\" border=\"1\" width=\"70%\" cellspacing=\"0\" cellpadding=\"2\" align=\"center\"> <tbody> <tr> <td style=\"color: white; text-align: center; width: 393.8px;\" colspan=\"3\" align=\"center\" bgcolor=\"#0154b6\">MANEJO DTA</span></strong></td> </tr> <tr> <td style=\"color: #000000; text-align: center; width: 200.167px;\"><strong>DESCRIPCION </strong></td> <td style=\"color: #000000; text-align: center; width: 124.333px;\"><strong>BASE DE LIQUIDACION </strong></td> <td style=\"color: #000000; text-align: center; width: 57.3px;\"><strong>TARIFA</strong></td> </tr> <tr> <td>Comisi&oacute;n Advalorem </span></td> <td>Valor FOB </span></td> <td>0,10%</span></td> </tr> <tr> <td>Comisi&oacute;n m&iacute;nima </span></td> <td>&nbsp;</td> <td>$ 350.000</span></td> </tr> <tr> <td>Finalizaci&oacute;n DTA puerto para<br />Exportaciones desde Zona<br />Franca</span></td> <td>Valor por operaci&oacute;n </span></td> <td>$ 150.000</span></td> </tr> </tbody> </table> <p>&nbsp;</p> <table class=\"tabla\" border=\"1\" width=\"70%\" cellspacing=\"0\" cellpadding=\"2\" align=\"center\"> <tbody> <tr> <td style=\"color: white; text-align: center; width: 393.8px;\" colspan=\"3\" align=\"center\" bgcolor=\"#0154b6\">SERVICIOS ADICIONALES</td> </tr> <tr> <td style=\"border: 1px solid #000000;\" align=\"left\" valign=\"middle\" height=\"22\"><strong><span style=\"font-family: Arial-BoldMT;\">DESCRIPCION </span></strong></td> <td style=\"border: 1px solid #000000;\" align=\"left\" valign=\"middle\"><strong><span style=\"font-family: Arial-BoldMT;\">BASE DE LIQUIDACION </span></strong></td> <td style=\"border: 1px solid #000000;\" align=\"left\" valign=\"middle\"><strong><span style=\"font-family: Arial-BoldMT;\">TARIFA</span></strong></td> </tr> <tr> <td>Asesor&iacute;as solicitud de<br />resoluciones DIAN.</td> <td>Por tramite</td> <td>$ 1.000.000</td> </tr> <tr> <td  colspan=\"3\"><em><strong>Observaciones: Esta tarifa est&aacute; dada para tr&aacute;mite y solicitud de inscripciones ante la DIAN.</strong></em></td> </tr> <tr> <td  rowspan=\"2\">Gastos de vi&aacute;ticos por tramites<br />en administraciones donde no<br />contamos con oficinas (CLO,<br />BAQ,SMR, MDE)</td> <td>2 Primeras d&iacute;as</td> <td>$ 450.000</td> </tr> <tr> <td>D&iacute;a adicional</td> <td>$ 200.000</td> </tr> </tbody> </table> <p>&nbsp;</p> <p>Observaciones: Con el &aacute;nimo de ofrecer a nuestros clientes el manejo de tr&aacute;mites aduaneros en las principales administraciones del pa&iacute;s nuestros funcionarios cuentan con vinculaci&oacute;n a nivel nacional ante la DIAN, para as&iacute; poder prestar nuestros servicios.<br /><br /><em><strong>NOTA: La tarifa mencionada no incluye costos de tiquetes; en caso de presentarse, estos ser&aacute;n facturados como un pago a tercero con su respectivo soporte.</strong></em></p> <p>&nbsp;</p> <p style=\"color: #ff0000; text-align: center;\"><strong>CUSTOM</strong></p> <p>&nbsp;</p> <table class=\"tabla\" border=\"1\" width=\"70%\" cellspacing=\"0\" cellpadding=\"2\" align=\"center\"> <tbody> <tr> <td style=\"color: white; text-align: center; width: 393.8px;\" colspan=\"3\" align=\"center\" bgcolor=\"#0154b6\">TARIFAS TRAMITE IMPORTACION: APLICAN POR DOCUMENTO DE TRANSPORTE (AWB Y/O BL)</span></strong></td> </tr> <tr> <td>&bull; De USD 1 Hasta USD 50.000 Tarifa M&iacute;nima.<br />&bull; De USD 50.001 Hasta USD 200.000 USD 0,25%. sobre valor CIF<br />NOTA: Para proyectos superiores a USD 200.0001 concretamos la tarifa a aplicar</span></td> <td>$ 220.000</span></td> </tr> <tr> <td>&bull; Tarifa Adicional por descargue Directo Aeropuerto (Cuando se requiera) </span></td> <td>$ 100.000</span></td> </tr> <tr> <td>&bull; Inspecci&oacute;n Previa En Bogot&aacute; y Acompa&ntilde;amiento en puertos (Por Doc. De Transporte<br />Carga normal LCL Hasta 6 Horas). Hora adicional $ 12.000<br />La anterior tarifa tambi&eacute;n aplica para Acompa&ntilde;amiento Inspecci&oacute;n Previa en Puertos<br />en contenedor de 20 pies y 40 Pies.</span></td> <td>$ 80.000</span></td> </tr> <tr> <td>&bull; Inspecci&oacute;n Previa en Bogot&aacute; Contenedor de 20 pies</span></td> <td>$ 140.000</span></td> </tr> <tr> <td>&bull; Inspecci&oacute;n Previa pies en Bogot&aacute; Contenedor de 40</span></td> <td>$ 180.000</span></td> </tr> <tr> <td colspan=\"2\" >NOTA: Para carga extradimensionada y/o registro de alto n&uacute;mero de referencias se acordar&aacute; la tarifa a aplicar de acuerdo a tarifa del operador portuario).<br />La inspecci&oacute;n previa en los puertos ser&aacute; facturado al costo del operador portuario y se adjuntar&aacute; el soporte correspondiente como pago realizado a terceros).</td> </tr> <tr> <td>&bull; Elaboraci&oacute;n y Formularios Declaraci&oacute;n Importaci&oacute;n c/u </span></td> <td>$ 15.000</span></td> </tr> <tr> <td>&bull; Elaboraci&oacute;n y Formularios Declaraci&oacute;n Andina de Valor c/u </span></td> <td>$ 15.000</span></td> </tr> <tr> <td>&bull; Elaboraci&oacute;n Licencias Vuce Hoja Principal (hasta 1800 caracteres) </span></td> <td>$ 80.000</span></td> </tr> <tr> <td>&bull; Elaboraci&oacute;n Licencias Vuce Hoja Adicional </span></td> <td>$ 45.000</span></td> </tr> <tr> <td>&bull; Tramites Vistos Buenos (Mincomercio, Dian, Invima, Ica y dem&aacute;s entidades cuando se<br />requieran en la ejecuci&oacute;n de los procesos) Hasta 4 productos.</span></td> <td>$ 60.000</span></td> </tr> <tr> <td>&bull; Clasificaci&oacute;n Arancelaria por producto (Cuando se requiera) </span></td> <td>$ 40.000</span></td> </tr> <tr> <td>&bull; Tr&aacute;mite de DTA (Cuando se requiera) </span></td> <td>$ 220.000</span></td> </tr> <tr> <td>&bull; Recargo Adicional por tr&aacute;mite en Complejo Agua Dulce (B/ventura) </span></td> <td>$ 80.000</span></td> </tr> <tr> <td>&bull; Gastos varios Agrupados </span></td> <td>$ 80.000</span></td> </tr> <tr> <td>&bull; IVA 19% Sobre gastos propios</span></td> </tr> <tr> <td colspan=\"2\" ><strong>INGRESOS A TERCEROS: (Formularios al Costo, gastos bancarios 4x1000, no incluidos)</strong></td> </tr> <tr> <td>&bull; Formularios Licencias VUCE al costo (Cuando se requiera) </td> <td style=\"border: 1px solid #000000;\" align=\"right\" valign=\"middle\"><span style=\"color: #000000;\">$ 30.000</span></td> </tr> </tbody> </table> <p>&nbsp;</p> <table class=\"tabla\" border=\"1\" width=\"70%\" cellspacing=\"0\" cellpadding=\"2\" align=\"center\"> <tbody> <tr> <td style=\"color: white; text-align: center; width: 393.8px;\" colspan=\"2\" align=\"center\" bgcolor=\"#0154b6\">TARIFAS TRAMITE EXPORTACI&Oacute;N: APLICAN POR DOCUMENTO DE TRANSPORTE (AWB Y/O BL)</td> </tr> <tr> <td>&bull; Tarifa sobre el Valor FOB 0,25%. M&iacute;nima</td> <td>$ 220.000</td> </tr> <tr> <td>&bull; Elaboraci&oacute;n Declaraci&oacute;n Exportaci&oacute;n (DEX)</td> <td>$ 15.000</td> </tr> <tr> <td>&bull; Clasificaci&oacute;n Arancelaria Por Producto (Cuando se requiera)</td> <td>$ 40.000</td> </tr> <tr> <td>&bull; Elaboraci&oacute;n Criterios de Origen (Por Producto. Criterio v&aacute;lido x 2 a&ntilde;os)</td> <td>$ 90.000</td> </tr> <tr> <td>&bull; Elaboraci&oacute;n Certificado de Origen (Cobro x cada Factura de Exportaci&oacute;n.)</td> <td>$ 45.000</td> </tr> <tr> <td>&bull; Acompa&ntilde;amiento Inspecci&oacute;n Antinarc&oacute;ticos</td> <td>$ 80.000</td> </tr> <tr> <td>&bull; Tramites Vistos Buenos (Mincomercio, Dian, Invima, Ica y dem&aacute;s entidades cuando se requieran en la ejecuci&oacute;n de los procesos) Hasta 4 productos.</td> <td>$ 60.000</td> </tr> <tr> <td>&bull; Gastos Varios Agrupados</td> <td>$ 80.000</td> </tr> <tr> <td>&bull; Recargo Adicional por tr&aacute;mite en Complejo Agua Dulce (B/ventura)</td> <td>$ 80.000</td> </tr> <tr> <td  colspan=\"2\">&bull; IVA 19% (Sobre Ingresos Propios)</td> </tr> <tr> <td  colspan=\"2\">INGRESOS A TERCEROS: (Formularios al Costo, gastos bancarios 4x1000, no incluidos)</td> </tr> <tr> <td>&bull; Formularios Licencias VUCE</td> <td><span style=\"color: #000000;\">$ 30.000</span></td> </tr> </tbody> </table> <p>&nbsp;</p> <table class=\"tabla\" border=\"1\" width=\"70%\" cellspacing=\"0\" cellpadding=\"2\" align=\"center\"> <tbody> <tr> <td style=\"color: white; text-align: center; width: 393.8px;\" colspan=\"2\" align=\"center\" bgcolor=\"#0154b6\">TARIFAS EXPORTACI&Oacute;N ESPECIALES ARTES ANDINOS: APLICAN POR DOCUMENTO DE TRANSPORTE (AWB Y/O BL)</td> </tr> <tr> <td>&bull; Comisi&oacute;n M&iacute;nima hasta 3 Exportadores (Factura individual x exportador) 1 BL<br />por contenedor.</td> <td>$ 470.000</td> </tr> <tr> <td>&bull; Tarifa a partir de 4 Exportadores (Factura individual x exportador)<br />Este valor se adiciona a la comisi&oacute;n m&iacute;nima</td> <td>$ 82.000</td> </tr> <tr> <td>&bull; Elaboraci&oacute;n declaraci&oacute;n Exportaci&oacute;n DEX (Por Factura de cada exportador)</td><td>$ 15.000</td> </tr> <tr> <td>&bull; Acompa&ntilde;amiento Inspecci&oacute;n Antinarc&oacute;ticos Domingos y Festivos</td> <td>$ 72.000</td> </tr> <tr> <td  colspan=\"2\">NOTA: Los sellos de seguridad, se facturan al costo. Los dem&aacute;s &iacute;tems que requieran estos procesos de exportaci&oacute;n, aplican las tarifas normales.</td> </tr> <tr> <td>&bull; Gastos Varios Agrupados </span></td> <td>$ 80.000</span></td> </tr> <tr> <td>&bull; Recargo Adicional por tr&aacute;mite en Complejo Agua Dulce (B/ventura) </span></td> <td>$ 80.000</span></td> </tr> <tr> <td colspan=\"2\" >&bull; IVA 19% (Sobre Ingresos Propios)</span></td> </tr> <tr> <td colspan=\"2\" ><strong>INGRESOS A TERCEROS: (Formularios al Costo, gastos bancarios 4x1000, no incluidos)</span></strong></td> </tr> <tr> <td>&bull; Formularios Licencias VUCE </td> <td>$ 30.000</td> </tr> </tbody> </table> <p>&nbsp;</p> <p class=\"western\" style=\"margin-bottom: 0.28cm; border: none; padding: 0cm; line-height: 108%; orphans: 2; widows: 2;\" align=\"left\"><strong>NO INCLUYE</strong> gastos como liberaciones, cargue, descargue, formularios, gastos en puerto, ni pago de impuestos arancelarios, etiquetado, etc. Las operaciones de importaci&oacute;n por v&iacute;a mar&iacute;tima toman en promedio cinco (5) d&iacute;as h&aacute;biles como m&aacute;ximo y tres (3) d&iacute;as h&aacute;biles como m&aacute;ximo para operaciones a&eacute;reas, contados a partir de la disponibilidad de la carga en el dep&oacute;sito de aduanas, puerto o aeropuerto, siempre y cuando contemos con toda la documentaci&oacute;n completa y correcta antes de la llegada de la mercanc&iacute;a al pa&iacute;s. Es muy importante tener en cuenta que cuando la mercanc&iacute;a requiera registro de importaci&oacute;n y vistos buenos se requiere las facturas proformas y datos de la mercanc&iacute;a para elaborarlos, obtener los permisos y vistos buenos seg&uacute;n la entidad, estos llevar&aacute;n el respectivo soporte de pago para la obtenci&oacute;n del mismo seg&uacute;n la tarifa vigente de cada entidad. Para el caso del INVIMA tiene un per&iacute;odo de cinco (5) d&iacute;as h&aacute;biles para el estudio y aprobaci&oacute;n del r&eacute;gimen de previa. Todos deben obtenerse antes de la llegada de la carga para su normal nacionalizaci&oacute;n. Es necesario tener la suficiente informaci&oacute;n sobre la mercanc&iacute;a (cat&aacute;logos, fichas t&eacute;cnicas, etc.) para su respectiva clasificaci&oacute;n arancelaria. En caso de que la mercanc&iacute;a sea parcializada por la aerol&iacute;nea- naviera y/o se deba presentar nacionalizaciones separadas y/o parciales, se cobrar&aacute;n los costos y agenciamiento generados por cada proceso de operaci&oacute;n de nacionalizaci&oacute;n. Servicios o actividades no incluidas expresamente en este documento o sus anexos se entienden excluidos y se cobrar&aacute;n por separado.</p>'),
(16, 'descripcion_aduana_lcl', 'TEXTO PARAMETRIZACION ADUANA LCL<br>\r\nVestibulum vel nulla at diam consectetur egestas a egestas ex. Nullam fringilla pulvinar ligula vel gravida. Ut sollicitudin sem at quam accumsan, vulputate iaculis sapien sollicitudin. Vivamus aliquam velit id quam sodales pharetra. Aenean mauris nunc, sollicitudin sit amet nisi sit amet, convallis viverra tellus. In fringilla mattis ligula, ac auctor lectus hendrerit a. Proin et lorem et tellus sollicitudin egestas ut in nunc. Vivamus tristique elit eu rhoncus fringilla.'),
(17, 'condiciones_terrestre_fcl', '<p><strong>CONDICIONES GENERALES APLICAN A CARGA NACIONALIZADA FCL</strong><strong></strong></p>\r\n<p><em>El siguiente texto es una muestra para su verificacion</em><em>:</em><em></em></p>\r\n<p><br />LAS TARIFAS INCLUYEN: Flete terrestre origen destino, coordinacion logistica, informes diarios sobre el desarrollo de la operacion.</p>\r\n<p>LAS TARIFAS NO INCLUYEN: Seguro de la mercancia, cargue del contenedor, descargue de la mercancia, tiempo muerto o stand by en sitio de descargue por motivos ajenos al transporte, acompa&ntilde;amiento o dispositivos de seguridad a la carga.</p>'),
