(23, 'condiciones_flete_aereo', '<p><strong>CONDICIONES GENERALES APLICAN A TODOS LOS FLETES </strong><strong>AEREO</strong><strong></strong></p>\r\n<p><em>El siguiente texto es una muestra para su verificacion</em><em>:</em><em><br /></em></p>\r\n<p>*Tarifas para carga general no Aplica para carga &nbsp;&nbsp;peligrosa ni extradimensionada.</p>\r\n<p>*Tarifas sujetas a cambios sin previo aviso.</p>\r\n<p>*Las Cargas con Transbordos Estan Sujetas a Conexion en el &nbsp;&nbsp;Puerto Correspondiente.</p>\r\n<p>El Flete Internacional NO incluye seguro de la carga, en caso de requerirlo este debe ser solictado por escrito.</p>\r\n<p>Para las cargas que tengan mas peso que volumen,se genera un recargo por densidad del 50% sobre el total del flete si por algun motivo NOMBRE DE LA EMPRESA debe emitir el HBL en destino, este &nbsp;tendria un valor de USD 25 / HBL.</p>'),
(24, 'condiciones_bodega_aereo', '<p><span style=\"font-size: x-small;\"><span style=\"font-family: tahoma,arial,helvetica,sans-serif;\">OTROS GASTOS:</span></span></p>\r\n<p><span style=\"font-size: x-small;\"><span style=\"font-family: tahoma,arial,helvetica,sans-serif;\">* Papeleria&nbsp; COP$ 20.000<br />* Formulario: COP$ 28.000 Cada Uno<br />Nota: Para carga aerea el&nbsp; costo del Bodegaje aplica hasta 250Kgs de ese peso en adelante se cobrara COP$ 20 / kg, el ultimo saldo de cada carga tiene una tarifa Minima Neta de COP $ 100.00 + Iva ( unicamente en caso de mas de tres nacionalizaciones parciales )<br /></span></span></p>\r\n<p>Otros Servicios:<br />* Etiquetado&nbsp; COP$ 350 por prenda Minimo COP$ 320.000<br />* Salida al resto del mundo COP$ 300.000<br />* Unificacion ( reempaque ) COP 40.000 por proceso mas IVA<span style=\"font-size: x-small;\"></span></p>\r\n<p><span style=\"font-size: x-small;\"></span></p>'),
(25, 'descripcion_seguro_aereo', '<p style=\"text-align: left;\"><span style=\"font-size: x-small;\"><span style=\"font-family: tahoma,arial,helvetica,sans-serif;\"><br />Condiciones  Generales&nbsp; Seguro, Adjunto<br /></span></span><span style=\"font-size: x-small;\"></span></p>'),
