(26, 'descripcion_aduana_aereo', 'Fusce cursus aliquet nulla, sit amet molestie turpis vehicula sed. Curabitur faucibus turpis id facilisis congue. Nullam non lobortis mauris. Sed commodo molestie lorem tristique pellentesque. Aliquam vel justo enim. In velit magna, pretium nec finibus non, iaculis ut quam. Pellentesque elementum elit ut lobortis rhoncus. Integer ac magna vel eros aliquam rhoncus. Mauris non sapien semper, tempus elit vel, volutpat ex. Aenean pretium metus vel odio laoreet, id pulvinar est mollis. Interdum et malesuada fames ac ante ipsum primis in faucibus. Suspendisse volutpat suscipit posuere. Praesent rhoncus feugiat augue, rutrum faucibus lectus dapibus eu. Nam vel nisl et dolor dictum euismod.\r\n\r\n'),
(27, 'condiciones_terrestre_aereo', '<p><strong>CONDICIONES GENERALES APLICAN A CARGA NACIONALIZADA AEREO</strong><strong></strong></p>\r\n<p><em>El siguiente texto es una muestra para su verificacion</em><em>:</em><em></em></p>\r\n<p>&nbsp;</p>\r\n<p>LAS TARIFAS INCLUYEN: Flete terrestre origen destino, coordinacion logistica, informes diarios sobre el desarrollo de la operacion.</p>\r\n<p>LAS TARIFAS NO INCLUYEN: Seguro de la mercancia, cargue de la mercancia, descargue de la mercancia, tiempo muerto o stand by en sitio de descargue por motivos ajenos al transporte, acompa&ntilde;amiento o dispositivos de seguridad a la carga.</p>\r\n<p>&nbsp;NOTA: En el caso de importacion o exportacion en que exista mas de una direccion de cargue, las mismas seran contempladas como adicionales y se cobraran de esa manera.</p>'),
(28, 'condiciones_flete_fcl', '<p><strong>ESTAS SON CONDICIONES GENERALES PARA FLETES FCL</strong></p>\r\n<p><em>El siguiente texto es una muestra para su verificacion</em><em>:</em><em></em></p>\r\n<p>BENEFICIOS ADICIONALES REF ( 62)</p>\r\n<p>*15 Dias libres para devolucion &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;de Contenedores</p>\r\n<p>*Exoneracion de Deposito</p>\r\n<p>*Drop Off en Bogota Sujeto a disponibilidad de &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;espacio en los patios. El costo del drop Off es de USD 150 / TEU</p>\r\n<p>*Si &nbsp;por algun motivo NOMBRE DE LA EMPRESA debe emitir el HBL en destino, este &nbsp;tendra un valor de USD 25 / HBL</p>\r\n<p>BENEFICIOS ADICIONALES REF ( 61)</p>\r\n<p>*20 Dias libres para devolucion &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;de Contenedores</p>\r\n<p>*Exoneracion &nbsp;de Deposito</p>\r\n<p>*Drop &nbsp;Off en Bogota Sujeto a disponibilidad de &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;espacio en los patios. &nbsp;El costo del drop Off es de USD 150 / TEU</p>\r\n<p>Si &nbsp;&nbsp;por algun motivo NOMBRE DE LA EMPRESA &nbsp;debe emitir el HBL en destino, este &nbsp;&nbsp;tendra un valor de USD 25 / HBL</p>'),
(29, 'condiciones_flete_lcl', '<p><strong>CONDICIONES GENERALES APLICAN A TODOS LOS FLETES LCL</strong><strong></strong></p>\r\n<p><em>El siguiente texto es una muestra para su verificacion</em><em>:</em><em></em></p>\r\n<p>&nbsp;*Tarifas para carga general no Aplica para carga &nbsp;&nbsp;peligrosa ni extradimensionada.</p>\r\n<p>*Tarifas sujetas a cambios sin previo aviso.</p>\r\n<p>*Las Cargas con Transbordos Estan Sujetas a Conexion en el &nbsp;&nbsp;Puerto Correspondiente.</p>\r\n<p>*El Flete Internacional NO incluye seguro de la carga, en caso de requerirlo este debe ser solictado por escrito.</p>\r\n<p>*Para las cargas que tengan mas peso que volumen,se genera un recargo por densidad del 50% sobre el total del flete si por algun motivo NOMBRE DE LA EMPRESA debe emitir el HBL en destino, este &nbsp;tendria un valor de USD 25 / HBL.</p>'),
