INSERT INTO `re_flete_cli_estados` (`id`, `campo_seguimientos_comunicados`, `titulo`, `estado`, `estadoSms`) VALUES
(1, 'agradecimiento_1', 'Agradecimiento 1', '<div id=\"nuevoEstado\">\r\n<div id=\"nuevoEstado\">\r\n<div id=\"nuevoEstado\">Estimado cliente,</div>\r\n<div>&nbsp;</div>\r\n<div>Agradecemos este nuevo embarque. Nuestro agente ya recibi&oacute; instrucciones y contactar&aacute; al shipper para dejarnos saber detalles de la carga.</div>\r\n<div>&nbsp;</div>\r\n<div>Cordial saludo.</div>\r\n</div>\r\n</div>', ''),
(2, 'agradecimiento_2', 'Agradecimiento 2', '<div id=\"nuevoEstado\">\r\n<div id=\"nuevoEstado\">Estimado cliente</div>\r\n<div>&nbsp;</div>\r\n<div>Informo que nuestro agente nos prealerto una nueva carga para ustedes con los detalles que aparecen en el encabezado de este mensaj.</div>\r\n<div>&nbsp;</div>\r\n<div>Nuestra oficina en origen est&aacute; trabajando junto con la l&iacute;nea naviera para tener espacio para este despacho y nos informara una vez contemos con el prebooking de la carga.</div>\r\n<div>&nbsp;</div>\r\n<div>En cuanto tenga detalles de booking completos, lo notificare de inmediato.</div>\r\n<div>&nbsp;</div>\r\n<div>Cordial Saludo,</div>\r\n</div>', ''),
(3, 'detalles_carga', 'DETALLES DE LA CARGA', '<div id=\"nuevoEstado\">\r\n<div id=\"nuevoEstado\">Estimado cliente</div>\r\n<div>&nbsp;</div>\r\n<div>Nos permitimos informar detalles de la carga reportados por parte del shipper:</div>\r\n<div>&nbsp;</div>\r\n<div>SHIPPER:&nbsp;<input class=\"newStInptSeg\" type=\"button\" value=\"|@shipper|\" /></div>\r\n<div>CONSIGNEE: <input class=\"newStInptSeg\" type=\"button\" value=\"|@idcliente|\" /></div>\r\n<div>POL:<input class=\"newStInptSeg\" type=\"button\" value=\"|@puerto_origen|\" />&nbsp;&nbsp;&nbsp;</div>\r\n<div>POD:<input class=\"newStInptSeg\" type=\"button\" value=\"|@puerto_destino|\" /> &nbsp;&nbsp;&nbsp;</div>\r\n<div>COMMODITY:</div>\r\n<div>20:<input class=\"newStInptSeg\" type=\"button\" value=\"|@n20|\" /> , 40: <input class=\"newStInptSeg\" type=\"button\" value=\"|@n40|\" /> , n40hq : <input class=\"newStInptSeg\" type=\"button\" value=\"|@n40hq|\" /></div>\r\n<div><input class=\"newStInptSeg\" type=\"button\" value=\"|@peso|\" />KG&nbsp;</div>\r\n<div><input class=\"newStInptSeg\" type=\"button\" value=\"|@volumen|\" />&nbsp;M3</div>\r\n<div>&nbsp;</div>\r\n<div>Nos informa el shipper que la carga estar&aacute; lista el día <input class=\"newStInptSeg\" type=\"button\" value=\"|@request_ship_date|\" /> , Estaremos informando cualquier novedad.</div>\r\n<div>&nbsp;</div>\r\n<div>Cordial&nbsp; Saludo,</div>\r\n</div>', ''),
(4, 'booking', 'BOOKING', '<div id=\"nuevoEstado\">\r\n<div id=\"nuevoEstado\">\r\n<div id=\"nuevoEstado\">\r\n<div id=\"nuevoEstado\">Estimado cliente</div>\r\n<div>&nbsp;</div>\r\n<div>Informo que contamos con los siguientes detalles de booking:</div>\r\n<div>&nbsp;</div>\r\n<div>&nbsp;&nbsp;&nbsp; MN:&nbsp;<input class=\"newStInptSeg\" type=\"button\" value=\"|@motonave|\" /></div>\r\n<div>&nbsp;&nbsp;&nbsp; ETD: <input class=\"newStInptSeg\" type=\"button\" value=\"|@etd|\" /></div>\r\n<div>&nbsp;</div>\r\n<div>Quedo atenta a sus amables comentarios</div>\r\n<div>&nbsp;</div>\r\n<div>Cordial&nbsp; Saludo,</div>\r\n</div>\r\n</div>\r\n</div>', 'Kigen Informa Booking Order: |@number|  MN:  |@motonave|   ETD:  |@etd| , ETA:  |@eta| '),
(5, 'pre_booking', 'PRE BOOKING', '<div id=\"nuevoEstado\">\r\n<div id=\"nuevoEstado\">\r\n<div id=\"nuevoEstado\">Estimado cliente</div>\r\n<div>&nbsp;</div>\r\n<div>Informo que contamos con los siguientes detalles de booking:</div>\r\n<div>&nbsp;</div>\r\n<div>&nbsp;&nbsp;&nbsp; MN:&nbsp;<input class=\"newStInptSeg\" type=\"button\" value=\"|@motonave|\" /></div>\r\n&nbsp;&nbsp;&nbsp; ETD:<input class=\"newStInptSeg\" type=\"button\" value=\"|@etd|\" />\r\n<div>&nbsp;</div>\r\n<div>Quedo atenta a sus amables comentarios</div>\r\n<div>&nbsp;</div>\r\n<div>Cordial&nbsp; Saludo,</div>\r\n</div>\r\n</div>', ''),
(6, 'prealerta', 'PREALERTA', '<div id=\"nuevoEstado\">\r\n<div id=\"nuevoEstado\">\r\n<div id=\"nuevoEstado\">\r\n<div id=\"nuevoEstado\">Estimado cliente, Nos permitimos informar que la fecha de arribo de su carga a&uacute;n sigue para el <input class=\"newStInptSeg\" type=\"button\" value=\"|@eta|\" /></div>\r\n<p>&nbsp;Cordial Saludo</p>\r\n</div>\r\n</div>\r\n</div>', 'Kigen Informa que la Order:  |@number|  estima llegar el dia:  |@eta| '),
(7, 'confirmacion_arribo', 'CONFIRMACION DE ARRIBO', '<div id=\"nuevoEstado\">\r\n<div id=\"nuevoEstado\">\r\n<div id=\"nuevoEstado\">\r\n<div id=\"nuevoEstado\">\r\n<div id=\"nuevoEstado\">\r\n<div id=\"nuevoEstado\">\r\n<div id=\"nuevoEstado\">\r\n<div id=\"nuevoEstado\">\r\n<div id=\"nuevoEstado\">Estimado Cliente, Nos permitimos informar que su carga arrib&oacute; a <input class=\"newStInptSeg\" type=\"button\" value=\"|@puerto_destino|\" />(<input class=\"newStInptSeg\" type=\"button\" value=\"|@aduana|\" />) el d&iacute;a&nbsp;<input class=\"newStInptSeg\" type=\"button\" value=\"|@eta|\" /> en la <input class=\"newStInptSeg\" type=\"button\" value=\"|@clasificacionMoto|\" /> <input class=\"newStInptSeg\" type=\"button\" value=\"|@motonave|\" />seg&uacute;n manifiesto <input class=\"newStInptSeg\" type=\"button\" value=\"|@ref|\" /></div>\r\n<div>&nbsp;</div>\r\n<div>Cordial saludo</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>', 'Kigen Informa que la  Order:  |@number|  Arribo a POD:   |@puerto_destino|   el dia: |@eta| , en la MN:  |@motonave| , segun manifiesto No.:  |@ref|'),
(8, 'factura', 'FACTURA', '<div id=\"nuevoEstado\">\r\n<div id=\"nuevoEstado\">Estimado cliente</div>\r\n<div>Adjuntamos  factura <input class=\"newStInptSeg\" type=\"button\" value=\"|@no_factura|\" />correspondiente a su embarque.</div>\r\n<div>&nbsp;</div>\r\n<div>Cordial Saludo</div>\r\n</div>', ''),
(9, 'factura_certificados', 'FACTURA Y CERTIFICACION', '<div id=\"nuevoEstado\">\r\n<div id=\"nuevoEstado\">Estimado cliente</div>\r\n<div>&nbsp;</div>\r\n<div>Adjuntamos&nbsp; factura / certificaci&oacute;n de fletes y seguro (si aplica) correspondiente a su embarque, cualquier duda con mucho gusto estaremos atentos a solucionarla</div>\r\n<div>&nbsp;</div>\r\n<div>Cordial Saludo</div>\r\n</div>', ''),
(10, 'cert_flete', 'CERTIFICACION FLETES', '<div id=\"nuevoEstado\">\r\n<div id=\"nuevoEstado\">Estimado cliente</div>\r\n<div>Adjuntamos certificaci&oacute;n de fletes y seguro (si aplica) correspondiente a su embarque, cualquier duda con mucho gusto estaremos atentos a solucionarla</div>\r\n<div>&nbsp;</div>\r\n<div>Cordial Saludo</div>\r\n</div>', ''),
(11, 'contenedores', 'CONTENEDORES', '<div id=\"nuevoEstado\">\r\n<div id=\"nuevoEstado\">Estimado cliente.</div>\r\n<div>&nbsp;</div>\r\n<div>Confirmo que el contenedor mencionado en el adjunto ya tiene reserva para ser devuelto&nbsp; de acuerdo con su instrucci&oacute;n&nbsp;</div>\r\n<div>&nbsp;</div>\r\n<div>Adjuntamos confirmaci&oacute;n de la naviera</div>\r\n<div>&nbsp;</div>\r\n<div>Cordial Saludo</div>\r\n</div>', ''),
(12, 'nota_credito', 'NOTA CREDITO', '<div id=\"nuevoEstado\">\r\n<div id=\"nuevoEstado\">Estimado cliente</div>\r\n<div>&nbsp;</div>\r\n<div>Adjunto nota cr&eacute;dito aplicada a la factura No. <input class=\"newStInptSeg\" type=\"button\" value=\"|@no_factura|\" />/ <input class=\"newStInptSeg\" type=\"button\" value=\"|@fecha_factura|\" />.</div>\r\n<div>&nbsp;</div>\r\n<div>Cordial Saludo.</div>\r\n</div>', ''),
(13, 'draft_hbl', 'DRAFT HBL', '<div id=\"nuevoEstado\">\r\n<div id=\"nuevoEstado\">Estimado cliente</div>\r\n<div>&nbsp;</div>\r\n<div>Adjuntamos&nbsp;&nbsp;<input class=\"newStInptSeg\" type=\"button\" value=\"|@clasificacionHbl|\" /> draft para Su Vo Bo y aprobaci&oacute;n, de no recibir correcciones en las pr&oacute;ximas 4 horas el documento se dar&aacute; por aceptado y cualquier correcci&oacute;n posterior tendr&aacute; un costo de USD 50.</div>\r\n<div>&nbsp;</div>\r\n<div>Quedamos&nbsp; atentos&nbsp; a sus amables comentarios</div>\r\n<div>&nbsp;</div>\r\n<div>Cordial Saludo</div>\r\n</div>', ''),
(14, 'hbl_final', 'HBL FINAL', '<div id=\"nuevoEstado\">\r\n<div id=\"nuevoEstado\">Estimado cliente</div>\r\n<div>&nbsp;</div>\r\n<div>Adjuntamos&nbsp;&nbsp;<input class=\"newStInptSeg\" type=\"button\" value=\"|@clasificacionHbl|\" /> final&nbsp; para su informaci&oacute;n, de no recibir correcciones en las pr&oacute;ximas 4 horas el documento se dar&aacute; por aceptado y cualquier correcci&oacute;n posterior tendr&aacute; un costo de USD 50.</div>\r\n<div>&nbsp;</div>\r\n<div>Quedamos&nbsp; atentos&nbsp; a sus amables comentarios</div>\r\n<div>&nbsp;</div>\r\n<div>Cordial Saludo,</div>\r\n</div>', ''),
(15, 'confirmacion_zarpe', 'CONFIRMACION DE ZARPE', '<div id=\"nuevoEstado\">\r\n<div id=\"nuevoEstado\">\r\n<div id=\"nuevoEstado\">\r\n<div id=\"nuevoEstado\">Estimado cliente</div>\r\n<div>&nbsp;</div>\r\n<div>Confirmo que su carga fue embarcada en la MN <input class=\"newStInptSeg\" type=\"button\" value=\"|@motonave|\" />, la cual zarpo el dia&nbsp;<input class=\"newStInptSeg\" type=\"button\" value=\"|@etd|\" /> y presenta un estimado de arribo para el <input class=\"newStInptSeg\" type=\"button\" value=\"|@eta|\" /></div>\r\n<div>&nbsp;</div>\r\n<div>Cordial saludo,</div>\r\n</div>\r\n</div>\r\n</div>', 'Kigen  Confirma zarpe Order:  |@number|  MN:   |@motonave|   ETD: |@etd| , ETA:  |@eta| '),
(16, 'seguro', 'SEGURO', '<div id=\"nuevoEstado\">Estimado Cliente,<br />Le informamos que su carga ya cuenta con P&oacute;liza de Seguro, la cual adjuntamos para su informaci&oacute;n y manejo.<br />Cordial Saludo.</div>', '');
